module.exports = JSON.parse("{\"noability\":{\"name\":\"No Ability\",\"num\":0,\"desc\":\"Does nothing.\",\"shortDesc\":\"Does nothing.\"},\"adaptability\":{\"name\":\"Adaptability\",\"num\":91,\"desc\":\"This Pokemon's moves that match any of its types have a same-type attack bonus (STAB) of 2 instead of 1.5, causing them to deal 2x damage instead of 1.5x damage.\",\"shortDesc\":\"This Pokemon's same-type attack bonus (STAB) is 2 instead of 1.5.\"},\"aerilate\":{\"name\":\"Aerilate\",\"num\":184,\"desc\":\"This Pokemon's Normal-type moves become Flying-type moves and have their power multiplied by 1.2. This effect comes after other effects that change a move's type, but before Ion Deluge and Electrify's effects.\",\"shortDesc\":\"This Pokemon's Normal-type moves become Flying type and have 1.2x power.\"},\"aftermath\":{\"name\":\"Aftermath\",\"num\":106,\"desc\":\"If this Pokemon is knocked out with a contact move, that move's user loses 1/4 of its maximum HP, rounded down. If any active Pokemon has the Damp Ability, this effect is prevented.\",\"shortDesc\":\"If this Pokemon is KOed with a contact move, that move's user loses 1/4 its max HP.\"},\"airlock\":{\"name\":\"Air Lock\",\"num\":76,\"desc\":\"While this Pokemon is active, the effects of weather conditions are disabled.\",\"shortDesc\":\"While this Pokemon is active, the effects of weather conditions are disabled.\"},\"analytic\":{\"name\":\"Analytic\",\"num\":148,\"desc\":\"The power of this Pokemon's move is multiplied by 1.3 if it is the last to move in a turn. Does not affect Doom Desire and Future Sight.\",\"shortDesc\":\"This Pokemon's attacks have 1.3x power if it is the last to move in a turn.\"},\"angerpoint\":{\"name\":\"Anger Point\",\"num\":83,\"desc\":\"If this Pokemon, but not its substitute, is struck by a critical hit, its Attack is raised by 12 stages.\",\"shortDesc\":\"If this Pokemon (not its substitute) takes a critical hit, its Attack is raised 12 stages.\"},\"angershell\":{\"name\":\"Anger Shell\",\"num\":271,\"desc\":\"When this Pokemon has more than 1/2 its maximum HP and takes damage from an attack bringing it to 1/2 or less of its maximum HP, its Attack, Special Attack, and Speed are raised by 1 stage, and its Defense and Special Defense are lowered by 1 stage. This effect applies after all hits from a multi-hit move. This effect is prevented if the move had a secondary effect removed by the Sheer Force Ability.\",\"shortDesc\":\"At 1/2 or less of this Pokemon's max HP: +1 Atk, Sp. Atk, Spe, and -1 Def, Sp. Def.\"},\"anticipation\":{\"name\":\"Anticipation\",\"num\":107,\"desc\":\"On switch-in, this Pokemon is alerted if any opposing Pokemon has an attack that is super effective against this Pokemon, or an OHKO move. This effect considers any move that deals direct damage as an attacking move of its respective type, Hidden Power counts as its determined type, and Judgment, Multi-Attack, Natural Gift, Revelation Dance, Techno Blast, and Weather Ball are considered Normal-type moves.\",\"shortDesc\":\"On switch-in, this Pokemon shudders if any foe has a supereffective or OHKO move.\"},\"arenatrap\":{\"name\":\"Arena Trap\",\"num\":71,\"desc\":\"Prevents opposing Pokemon from choosing to switch out unless they are airborne, are holding a Shed Shell, or are a Ghost type.\",\"shortDesc\":\"Prevents opposing Pokemon from choosing to switch out unless they are airborne.\"},\"armortail\":{\"name\":\"Armor Tail\",\"num\":296,\"desc\":\"Priority moves used by opposing Pokemon targeting this Pokemon or its allies are prevented from having an effect.\",\"shortDesc\":\"This Pokemon and its allies are protected from opposing priority moves.\"},\"aromaveil\":{\"name\":\"Aroma Veil\",\"num\":165,\"desc\":\"This Pokemon and its allies cannot become affected by Attract, Disable, Encore, Heal Block, Taunt, or Torment.\",\"shortDesc\":\"Protects user/allies from Attract, Disable, Encore, Heal Block, Taunt, and Torment.\"},\"asoneglastrier\":{\"name\":\"As One (Glastrier)\",\"num\":266,\"desc\":\"Combination of the Unnerve and Chilling Neigh Abilities.\",\"shortDesc\":\"Combination of the Unnerve and Chilling Neigh Abilities.\"},\"asonespectrier\":{\"name\":\"As One (Spectrier)\",\"num\":267,\"desc\":\"Combination of the Unnerve and Grim Neigh Abilities.\",\"shortDesc\":\"Combination of the Unnerve and Grim Neigh Abilities.\"},\"aurabreak\":{\"name\":\"Aura Break\",\"num\":188,\"desc\":\"While this Pokemon is active, the effects of the Dark Aura and Fairy Aura Abilities are reversed, multiplying the power of Dark- and Fairy-type moves, respectively, by 3/4 instead of 1.33.\",\"shortDesc\":\"While this Pokemon is active, the Dark Aura and Fairy Aura power modifier is 0.75x.\"},\"baddreams\":{\"name\":\"Bad Dreams\",\"num\":123,\"desc\":\"Causes opposing Pokemon to lose 1/8 of their maximum HP, rounded down, at the end of each turn if they are asleep.\",\"shortDesc\":\"Causes sleeping foes to lose 1/8 of their max HP at the end of each turn.\"},\"ballfetch\":{\"name\":\"Ball Fetch\",\"num\":237,\"desc\":\"No competitive use.\",\"shortDesc\":\"No competitive use.\"},\"battery\":{\"name\":\"Battery\",\"num\":217,\"desc\":\"This Pokemon's allies have the power of their special attacks multiplied by 1.3.\",\"shortDesc\":\"This Pokemon's allies have the power of their special attacks multiplied by 1.3.\"},\"battlearmor\":{\"name\":\"Battle Armor\",\"num\":4,\"desc\":\"This Pokemon cannot be struck by a critical hit.\",\"shortDesc\":\"This Pokemon cannot be struck by a critical hit.\"},\"battlebond\":{\"name\":\"Battle Bond\",\"num\":210,\"desc\":\"If this Pokemon is a Greninja, its Attack, Special Attack, and Speed are raised by 1 stage if it attacks and knocks out another Pokemon. This effect can only happen once per battle.\",\"shortDesc\":\"After KOing a Pokemon: raises Attack, Sp. Atk, Speed by 1 stage. Once per battle.\"},\"beadsofruin\":{\"name\":\"Beads of Ruin\",\"num\":284,\"desc\":\"Active Pokemon without this Ability have their Special Defense multiplied by 0.75.\",\"shortDesc\":\"Active Pokemon without this Ability have their Special Defense multiplied by 0.75.\"},\"beastboost\":{\"name\":\"Beast Boost\",\"num\":224,\"desc\":\"This Pokemon's highest stat is raised by 1 stage if it attacks and knocks out another Pokemon. Stat stage changes are not considered. If multiple stats are tied, Attack, Defense, Special Attack, Special Defense, and Speed are prioritized in that order.\",\"shortDesc\":\"This Pokemon's highest stat is raised by 1 if it attacks and KOes another Pokemon.\"},\"berserk\":{\"name\":\"Berserk\",\"num\":201,\"desc\":\"When this Pokemon has more than 1/2 its maximum HP and takes damage from an attack bringing it to 1/2 or less of its maximum HP, its Special Attack is raised by 1 stage. This effect applies after all hits from a multi-hit move. This effect is prevented if the move had a secondary effect removed by the Sheer Force Ability.\",\"shortDesc\":\"This Pokemon's Sp. Atk is raised by 1 when it reaches 1/2 or less of its max HP.\"},\"bigpecks\":{\"name\":\"Big Pecks\",\"num\":145,\"desc\":\"Prevents other Pokemon from lowering this Pokemon's Defense stat stage.\",\"shortDesc\":\"Prevents other Pokemon from lowering this Pokemon's Defense stat stage.\"},\"blaze\":{\"name\":\"Blaze\",\"num\":66,\"desc\":\"When this Pokemon has 1/3 or less of its maximum HP, rounded down, its offensive stat is multiplied by 1.5 while using a Fire-type attack.\",\"shortDesc\":\"At 1/3 or less of its max HP, this Pokemon's offensive stat is 1.5x with Fire attacks.\"},\"bulletproof\":{\"name\":\"Bulletproof\",\"num\":171,\"desc\":\"This Pokemon is immune to bomb and bullet moves.\",\"shortDesc\":\"This Pokemon is immune to ballistic moves.\"},\"cheekpouch\":{\"name\":\"Cheek Pouch\",\"num\":167,\"desc\":\"If this Pokemon eats a held Berry, it restores 1/3 of its maximum HP, rounded down, in addition to the Berry's effect. This effect can also activate after the effects of Bug Bite, Fling, Pluck, Stuff Cheeks, and Teatime if the eaten Berry had an effect on this Pokemon.\",\"shortDesc\":\"If this Pokemon eats a Berry, it restores 1/3 of its max HP after the Berry's effect.\"},\"chillingneigh\":{\"name\":\"Chilling Neigh\",\"num\":264,\"desc\":\"This Pokemon's Attack is raised by 1 stage if it attacks and knocks out another Pokemon.\",\"shortDesc\":\"This Pokemon's Attack is raised by 1 stage if it attacks and KOes another Pokemon.\"},\"chlorophyll\":{\"name\":\"Chlorophyll\",\"num\":34,\"desc\":\"If Sunny Day is active, this Pokemon's Speed is doubled. This effect is prevented if this Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"If Sunny Day is active, this Pokemon's Speed is doubled.\"},\"clearbody\":{\"name\":\"Clear Body\",\"num\":29,\"desc\":\"Prevents other Pokemon from lowering this Pokemon's stat stages.\",\"shortDesc\":\"Prevents other Pokemon from lowering this Pokemon's stat stages.\"},\"cloudnine\":{\"name\":\"Cloud Nine\",\"num\":13,\"desc\":\"While this Pokemon is active, the effects of weather conditions are disabled.\",\"shortDesc\":\"While this Pokemon is active, the effects of weather conditions are disabled.\"},\"colorchange\":{\"name\":\"Color Change\",\"num\":16,\"desc\":\"This Pokemon's type changes to match the type of the last move that hit it, unless that type is already one of its types. This effect applies after all hits from a multi-hit move. This effect is prevented if the move had a secondary effect removed by the Sheer Force Ability.\",\"shortDesc\":\"This Pokemon's type changes to the type of a move it's hit by, unless it has the type.\"},\"comatose\":{\"name\":\"Comatose\",\"num\":213,\"desc\":\"This Pokemon is considered to be asleep and cannot become affected by a non-volatile status condition or Yawn.\",\"shortDesc\":\"This Pokemon cannot be statused, and is considered to be asleep.\"},\"commander\":{\"name\":\"Commander\",\"num\":279,\"desc\":\"If this Pokemon is a Tatsugiri and a Dondozo is an active ally, this Pokemon goes into the Dondozo's mouth. The Dondozo has its Attack, Special Attack, Speed, Defense, and Special Defense raised by 2 stages. During the effect, the Dondozo cannot be switched out, this Pokemon cannot select an action, and attacks targeted at this Pokemon will be avoided but it will still take indirect damage. If this Pokemon faints during the effect, a Pokemon can be switched in as a replacement but the Dondozo remains unable to be switched out. If the Dondozo faints during the effect, this Pokemon regains the ability to select an action.\",\"shortDesc\":\"If ally is Dondozo: this Pokemon cannot act or be hit, +2 to all Dondozo's stats.\"},\"competitive\":{\"name\":\"Competitive\",\"num\":172,\"desc\":\"This Pokemon's Special Attack is raised by 2 stages for each of its stat stages that is lowered by an opposing Pokemon.\",\"shortDesc\":\"This Pokemon's Sp. Atk is raised by 2 for each of its stats that is lowered by a foe.\"},\"compoundeyes\":{\"name\":\"Compound Eyes\",\"num\":14,\"desc\":\"This Pokemon's moves have their accuracy multiplied by 1.3.\",\"shortDesc\":\"This Pokemon's moves have their accuracy multiplied by 1.3.\"},\"contrary\":{\"name\":\"Contrary\",\"num\":126,\"desc\":\"If this Pokemon has a stat stage raised it is lowered instead, and vice versa.\",\"shortDesc\":\"If this Pokemon has a stat stage raised it is lowered instead, and vice versa.\"},\"corrosion\":{\"name\":\"Corrosion\",\"num\":212,\"desc\":\"This Pokemon can poison or badly poison a Pokemon regardless of its typing.\",\"shortDesc\":\"This Pokemon can poison or badly poison a Pokemon regardless of its typing.\"},\"costar\":{\"name\":\"Costar\",\"num\":294,\"desc\":\"On switch-in, this Pokemon copies all of its ally's stat stage changes.\",\"shortDesc\":\"On switch-in, this Pokemon copies all of its ally's stat stage changes.\"},\"cottondown\":{\"name\":\"Cotton Down\",\"num\":238,\"desc\":\"When this Pokemon is hit by an attack, the Speed of all other Pokemon on the field is lowered by 1 stage.\",\"shortDesc\":\"If this Pokemon is hit, it lowers the Speed of all other Pokemon on the field 1 stage.\"},\"cudchew\":{\"name\":\"Cud Chew\",\"num\":291,\"desc\":\"If this Pokemon eats a Berry, it will eat that Berry again at the end of the next turn.\",\"shortDesc\":\"If this Pokemon eats a Berry, it will eat that Berry again at the end of the next turn.\"},\"curiousmedicine\":{\"name\":\"Curious Medicine\",\"num\":261,\"desc\":\"On switch-in, this Pokemon's allies have their stat stages reset to 0.\",\"shortDesc\":\"On switch-in, this Pokemon's allies have their stat stages reset to 0.\"},\"cursedbody\":{\"name\":\"Cursed Body\",\"num\":130,\"desc\":\"If this Pokemon is hit by an attack, there is a 30% chance that move gets disabled unless one of the attacker's moves is already disabled.\",\"shortDesc\":\"If this Pokemon is hit by an attack, there is a 30% chance that move gets disabled.\"},\"cutecharm\":{\"name\":\"Cute Charm\",\"num\":56,\"desc\":\"There is a 30% chance a Pokemon making contact with this Pokemon will become infatuated if it is of the opposite gender.\",\"shortDesc\":\"30% chance of infatuating Pokemon of the opposite gender if they make contact.\"},\"damp\":{\"name\":\"Damp\",\"num\":6,\"desc\":\"While this Pokemon is active, Explosion, Mind Blown, Misty Explosion, Self-Destruct, and the Aftermath Ability are prevented from having an effect.\",\"shortDesc\":\"Prevents Explosion/Mind Blown/Misty Explosion/Self-Destruct/Aftermath while active.\"},\"dancer\":{\"name\":\"Dancer\",\"num\":216,\"desc\":\"After another Pokemon uses a dance move, this Pokemon uses the same move. The copied move is subject to all effects that can prevent a move from being executed. A move used through this Ability cannot be copied again by other Pokemon with this Ability.\",\"shortDesc\":\"After another Pokemon uses a dance move, this Pokemon uses the same move.\"},\"darkaura\":{\"name\":\"Dark Aura\",\"num\":186,\"desc\":\"While this Pokemon is active, the power of Dark-type moves used by active Pokemon is multiplied by 1.33.\",\"shortDesc\":\"While this Pokemon is active, a Dark move used by any Pokemon has 1.33x power.\"},\"dauntlessshield\":{\"name\":\"Dauntless Shield\",\"num\":235,\"desc\":\"On switch-in, this Pokemon's Defense is raised by 1 stage. Once per battle.\",\"shortDesc\":\"On switch-in, this Pokemon's Defense is raised by 1 stage. Once per battle.\"},\"dazzling\":{\"name\":\"Dazzling\",\"num\":219,\"desc\":\"Priority moves used by opposing Pokemon targeting this Pokemon or its allies are prevented from having an effect.\",\"shortDesc\":\"This Pokemon and its allies are protected from opposing priority moves.\"},\"defeatist\":{\"name\":\"Defeatist\",\"num\":129,\"desc\":\"While this Pokemon has 1/2 or less of its maximum HP, its Attack and Special Attack are halved.\",\"shortDesc\":\"While this Pokemon has 1/2 or less of its max HP, its Attack and Sp. Atk are halved.\"},\"defiant\":{\"name\":\"Defiant\",\"num\":128,\"desc\":\"This Pokemon's Attack is raised by 2 stages for each of its stat stages that is lowered by an opposing Pokemon.\",\"shortDesc\":\"This Pokemon's Attack is raised by 2 for each of its stats that is lowered by a foe.\"},\"deltastream\":{\"name\":\"Delta Stream\",\"num\":191,\"desc\":\"On switch-in, the weather becomes Delta Stream, which removes the weaknesses of the Flying type from Flying-type Pokemon. This weather remains in effect until this Ability is no longer active for any Pokemon, or the weather is changed by the Desolate Land or Primordial Sea Abilities.\",\"shortDesc\":\"On switch-in, strong winds begin until this Ability is not active in battle.\"},\"desolateland\":{\"name\":\"Desolate Land\",\"num\":190,\"desc\":\"On switch-in, the weather becomes Desolate Land, which includes all the effects of Sunny Day and prevents damaging Water-type moves from executing. This weather remains in effect until this Ability is no longer active for any Pokemon, or the weather is changed by the Delta Stream or Primordial Sea Abilities.\",\"shortDesc\":\"On switch-in, extremely harsh sunlight begins until this Ability is not active in battle.\"},\"disguise\":{\"name\":\"Disguise\",\"num\":209,\"desc\":\"If this Pokemon is a Mimikyu, the first hit it takes in battle deals 0 neutral damage. Its disguise is then broken, it changes to Busted Form, and it loses 1/8 of its max HP. Confusion damage also breaks the disguise.\",\"shortDesc\":\"(Mimikyu only) The first hit it takes is blocked, and it takes 1/8 HP damage instead.\"},\"download\":{\"name\":\"Download\",\"num\":88,\"desc\":\"On switch-in, this Pokemon's Attack or Special Attack is raised by 1 stage based on the weaker combined defensive stat of all opposing Pokemon. Attack is raised if their Defense is lower, and Special Attack is raised if their Special Defense is the same or lower.\",\"shortDesc\":\"On switch-in, Attack or Sp. Atk is raised 1 stage based on the foes' weaker Defense.\"},\"dragonsmaw\":{\"name\":\"Dragon's Maw\",\"num\":263,\"desc\":\"This Pokemon's offensive stat is multiplied by 1.5 while using a Dragon-type attack.\",\"shortDesc\":\"This Pokemon's offensive stat is multiplied by 1.5 while using a Dragon-type attack.\"},\"drizzle\":{\"name\":\"Drizzle\",\"num\":2,\"desc\":\"On switch-in, this Pokemon summons Rain Dance.\",\"shortDesc\":\"On switch-in, this Pokemon summons Rain Dance.\"},\"drought\":{\"name\":\"Drought\",\"num\":70,\"desc\":\"On switch-in, this Pokemon summons Sunny Day.\",\"shortDesc\":\"On switch-in, this Pokemon summons Sunny Day.\"},\"dryskin\":{\"name\":\"Dry Skin\",\"num\":87,\"desc\":\"This Pokemon is immune to Water-type moves and restores 1/4 of its maximum HP, rounded down, when hit by a Water-type move. The power of Fire-type moves is multiplied by 1.25 when used on this Pokemon. At the end of each turn, this Pokemon restores 1/8 of its maximum HP, rounded down, if the weather is Rain Dance, and loses 1/8 of its maximum HP, rounded down, if the weather is Sunny Day. The weather effects are prevented if this Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"This Pokemon is healed 1/4 by Water, 1/8 by Rain; is hurt 1.25x by Fire, 1/8 by Sun.\"},\"earlybird\":{\"name\":\"Early Bird\",\"num\":48,\"desc\":\"This Pokemon's sleep counter drops by 2 instead of 1.\",\"shortDesc\":\"This Pokemon's sleep counter drops by 2 instead of 1.\"},\"eartheater\":{\"name\":\"Earth Eater\",\"num\":297,\"desc\":\"This Pokemon is immune to Ground-type moves and restores 1/4 of its maximum HP, rounded down, when hit by a Ground-type move.\",\"shortDesc\":\"This Pokemon heals 1/4 of its max HP when hit by Ground moves; Ground immunity.\"},\"effectspore\":{\"name\":\"Effect Spore\",\"num\":27,\"desc\":\"30% chance a Pokemon making contact with this Pokemon will be poisoned, paralyzed, or fall asleep.\",\"shortDesc\":\"30% chance of poison/paralysis/sleep on others making contact with this Pokemon.\"},\"electricsurge\":{\"name\":\"Electric Surge\",\"num\":226,\"desc\":\"On switch-in, this Pokemon summons Electric Terrain.\",\"shortDesc\":\"On switch-in, this Pokemon summons Electric Terrain.\"},\"electromorphosis\":{\"name\":\"Electromorphosis\",\"num\":280,\"desc\":\"This Pokemon gains the Charge effect when it takes a hit from an attack.\",\"shortDesc\":\"This Pokemon gains the Charge effect when it takes a hit from an attack.\"},\"embodyaspectcornerstone\":{\"name\":\"Embody Aspect (Cornerstone)\",\"num\":304,\"desc\":\"On switch-in, this Pokemon's Defense is raised by 1 stage.\",\"shortDesc\":\"On switch-in, this Pokemon's Defense is raised by 1 stage.\"},\"embodyaspecthearthflame\":{\"name\":\"Embody Aspect (Hearthflame)\",\"num\":303,\"desc\":\"On switch-in, this Pokemon's Attack is raised by 1 stage.\",\"shortDesc\":\"On switch-in, this Pokemon's Attack is raised by 1 stage.\"},\"embodyaspectteal\":{\"name\":\"Embody Aspect (Teal)\",\"num\":301,\"desc\":\"On switch-in, this Pokemon's Speed is raised by 1 stage.\",\"shortDesc\":\"On switch-in, this Pokemon's Speed is raised by 1 stage.\"},\"embodyaspectwellspring\":{\"name\":\"Embody Aspect (Wellspring)\",\"num\":302,\"desc\":\"On switch-in, this Pokemon's Special Defense is raised by 1 stage.\",\"shortDesc\":\"On switch-in, this Pokemon's Special Defense is raised by 1 stage.\"},\"emergencyexit\":{\"name\":\"Emergency Exit\",\"num\":194,\"desc\":\"When this Pokemon has more than 1/2 its maximum HP and takes damage bringing it to 1/2 or less of its maximum HP, it immediately switches out to a chosen ally. This effect applies after all hits from a multi-hit move. This effect is prevented if the move had a secondary effect removed by the Sheer Force Ability. This effect applies to both direct and indirect damage, except Curse and Substitute on use, Belly Drum, Pain Split, and confusion damage.\",\"shortDesc\":\"This Pokemon switches out when it reaches 1/2 or less of its maximum HP.\"},\"fairyaura\":{\"name\":\"Fairy Aura\",\"num\":187,\"desc\":\"While this Pokemon is active, the power of Fairy-type moves used by active Pokemon is multiplied by 1.33.\",\"shortDesc\":\"While this Pokemon is active, a Fairy move used by any Pokemon has 1.33x power.\"},\"filter\":{\"name\":\"Filter\",\"num\":111,\"desc\":\"This Pokemon receives 3/4 damage from supereffective attacks.\",\"shortDesc\":\"This Pokemon receives 3/4 damage from supereffective attacks.\"},\"flamebody\":{\"name\":\"Flame Body\",\"num\":49,\"desc\":\"30% chance a Pokemon making contact with this Pokemon will be burned.\",\"shortDesc\":\"30% chance a Pokemon making contact with this Pokemon will be burned.\"},\"flareboost\":{\"name\":\"Flare Boost\",\"num\":138,\"desc\":\"While this Pokemon is burned, the power of its special attacks is multiplied by 1.5.\",\"shortDesc\":\"While this Pokemon is burned, its special attacks have 1.5x power.\"},\"flashfire\":{\"name\":\"Flash Fire\",\"num\":18,\"desc\":\"This Pokemon is immune to Fire-type moves. The first time it is hit by a Fire-type move, its offensive stat is multiplied by 1.5 while using a Fire-type attack as long as it remains active and has this Ability. If this Pokemon is frozen, it cannot be defrosted by Fire-type attacks.\",\"shortDesc\":\"This Pokemon's Fire attacks do 1.5x damage if hit by one Fire move; Fire immunity.\"},\"flowergift\":{\"name\":\"Flower Gift\",\"num\":122,\"desc\":\"If this Pokemon is a Cherrim and Sunny Day is active, it changes to Sunshine Form and the Attack and Special Defense of it and its allies are multiplied by 1.5. These effects are prevented if the Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"If user is Cherrim and Sunny Day is active, it and allies' Attack and Sp. Def are 1.5x.\"},\"flowerveil\":{\"name\":\"Flower Veil\",\"num\":166,\"desc\":\"Grass-type Pokemon on this Pokemon's side cannot have their stat stages lowered by other Pokemon or have a non-volatile status condition inflicted on them by other Pokemon.\",\"shortDesc\":\"This side's Grass types can't have stats lowered or status inflicted by other Pokemon.\"},\"fluffy\":{\"name\":\"Fluffy\",\"num\":218,\"desc\":\"This Pokemon receives 1/2 damage from contact moves, but double damage from Fire moves.\",\"shortDesc\":\"This Pokemon takes 1/2 damage from contact moves, 2x damage from Fire moves.\"},\"forecast\":{\"name\":\"Forecast\",\"num\":59,\"desc\":\"If this Pokemon is a Castform, its type changes to the current weather condition's type, except Sandstorm. This effect is prevented if this Pokemon is holding a Utility Umbrella and the weather is Rain Dance or Sunny Day.\",\"shortDesc\":\"Castform's type changes to the current weather condition's type, except Sandstorm.\"},\"forewarn\":{\"name\":\"Forewarn\",\"num\":108,\"desc\":\"On switch-in, this Pokemon is alerted to the move with the highest power, at random, known by an opposing Pokemon. This effect considers OHKO moves to have 150 power, Counter, Mirror Coat, and Metal Burst to have 120 power, every other attacking move with an unspecified power to have 80 power, and non-damaging moves to have 1 power.\",\"shortDesc\":\"On switch-in, this Pokemon is alerted to the foes' move with the highest power.\"},\"friendguard\":{\"name\":\"Friend Guard\",\"num\":132,\"desc\":\"This Pokemon's allies receive 3/4 damage from other Pokemon's attacks.\",\"shortDesc\":\"This Pokemon's allies receive 3/4 damage from other Pokemon's attacks.\"},\"frisk\":{\"name\":\"Frisk\",\"num\":119,\"desc\":\"On switch-in, this Pokemon identifies the held items of all opposing Pokemon.\",\"shortDesc\":\"On switch-in, this Pokemon identifies the held items of all opposing Pokemon.\"},\"fullmetalbody\":{\"name\":\"Full Metal Body\",\"num\":230,\"desc\":\"Prevents other Pokemon from lowering this Pokemon's stat stages.\",\"shortDesc\":\"Prevents other Pokemon from lowering this Pokemon's stat stages.\"},\"furcoat\":{\"name\":\"Fur Coat\",\"num\":169,\"desc\":\"This Pokemon's Defense is doubled.\",\"shortDesc\":\"This Pokemon's Defense is doubled.\"},\"galewings\":{\"name\":\"Gale Wings\",\"num\":177,\"desc\":\"If this Pokemon is at full HP, its Flying-type moves have their priority increased by 1.\",\"shortDesc\":\"If this Pokemon is at full HP, its Flying-type moves have their priority increased by 1.\"},\"galvanize\":{\"name\":\"Galvanize\",\"num\":206,\"desc\":\"This Pokemon's Normal-type moves become Electric-type moves and have their power multiplied by 1.2. This effect comes after other effects that change a move's type, but before Ion Deluge and Electrify's effects.\",\"shortDesc\":\"This Pokemon's Normal-type moves become Electric type and have 1.2x power.\"},\"gluttony\":{\"name\":\"Gluttony\",\"num\":82,\"desc\":\"When this Pokemon is holding a Berry that usually activates with 1/4 or less of its maximum HP, it is eaten at 1/2 or less of its maximum HP instead.\",\"shortDesc\":\"This Pokemon eats Berries at 1/2 max HP or less instead of their usual 1/4 max HP.\"},\"goodasgold\":{\"name\":\"Good as Gold\",\"num\":283,\"desc\":\"This Pokemon is immune to Status moves.\",\"shortDesc\":\"This Pokemon is immune to Status moves.\"},\"gooey\":{\"name\":\"Gooey\",\"num\":183,\"desc\":\"Pokemon making contact with this Pokemon have their Speed lowered by 1 stage.\",\"shortDesc\":\"Pokemon making contact with this Pokemon have their Speed lowered by 1 stage.\"},\"gorillatactics\":{\"name\":\"Gorilla Tactics\",\"num\":255,\"desc\":\"This Pokemon's Attack is multiplied by 1.5, but it can only select the first move it executes. These effects are prevented while this Pokemon is Dynamaxed.\",\"shortDesc\":\"This Pokemon's Attack is 1.5x, but it can only select the first move it executes.\"},\"grasspelt\":{\"name\":\"Grass Pelt\",\"num\":179,\"desc\":\"If Grassy Terrain is active, this Pokemon's Defense is multiplied by 1.5.\",\"shortDesc\":\"If Grassy Terrain is active, this Pokemon's Defense is multiplied by 1.5.\"},\"grassysurge\":{\"name\":\"Grassy Surge\",\"num\":229,\"desc\":\"On switch-in, this Pokemon summons Grassy Terrain.\",\"shortDesc\":\"On switch-in, this Pokemon summons Grassy Terrain.\"},\"grimneigh\":{\"name\":\"Grim Neigh\",\"num\":265,\"desc\":\"This Pokemon's Special Attack is raised by 1 stage if it attacks and knocks out another Pokemon.\",\"shortDesc\":\"This Pokemon's Sp. Atk is raised by 1 stage if it attacks and KOes another Pokemon.\"},\"guarddog\":{\"name\":\"Guard Dog\",\"num\":275,\"desc\":\"This Pokemon is immune to the effect of the Intimidate Ability and raises its Attack by 1 stage instead. This Pokemon cannot be forced to switch out by another Pokemon's attack or item.\",\"shortDesc\":\"Immune to Intimidate. Intimidated: +1 Attack. Cannot be forced to switch out.\"},\"gulpmissile\":{\"name\":\"Gulp Missile\",\"num\":241,\"desc\":\"If this Pokemon is a Cramorant, it changes forme when it hits a target with Surf or uses the first turn of Dive successfully. It becomes Gulping Form with an Arrokuda in its mouth if it has more than 1/2 of its maximum HP remaining, or Gorging Form with a Pikachu in its mouth if it has 1/2 or less of its maximum HP remaining. If Cramorant gets hit in Gulping or Gorging Form, it spits the Arrokuda or Pikachu at its attacker, even if it has no HP remaining. The projectile deals damage equal to 1/4 of the target's maximum HP, rounded down; this damage is blocked by the Magic Guard Ability but not by a substitute. An Arrokuda also lowers the target's Defense by 1 stage, and a Pikachu paralyzes the target. Cramorant will return to normal if it spits out a projectile, switches out, or Dynamaxes.\",\"shortDesc\":\"When hit after Surf/Dive, attacker takes 1/4 max HP and -1 Defense or paralysis.\"},\"guts\":{\"name\":\"Guts\",\"num\":62,\"desc\":\"If this Pokemon has a non-volatile status condition, its Attack is multiplied by 1.5. This Pokemon's physical attacks ignore the burn effect of halving damage.\",\"shortDesc\":\"If this Pokemon is statused, its Attack is 1.5x; ignores burn halving physical damage.\"},\"hadronengine\":{\"name\":\"Hadron Engine\",\"num\":289,\"desc\":\"On switch-in, summons Electric Terrain. During Electric Terrain, Sp. Atk is 1.3333x.\",\"shortDesc\":\"On switch-in, summons Electric Terrain. During Electric Terrain, Sp. Atk is 1.3333x.\"},\"harvest\":{\"name\":\"Harvest\",\"num\":139,\"desc\":\"If the last item this Pokemon used is a Berry, there is a 50% chance it gets restored at the end of each turn. If Sunny Day is active, this chance is 100%.\",\"shortDesc\":\"If last item used is a Berry, 50% chance to restore it each end of turn. 100% in Sun.\"},\"healer\":{\"name\":\"Healer\",\"num\":131,\"desc\":\"30% chance this Pokemon's ally has its non-volatile status condition cured at the end of each turn.\",\"shortDesc\":\"30% chance this Pokemon's ally has its status cured at the end of each turn.\"},\"heatproof\":{\"name\":\"Heatproof\",\"num\":85,\"desc\":\"If a Pokemon uses a Fire-type attack against this Pokemon, that Pokemon's offensive stat is halved when calculating the damage to this Pokemon. This Pokemon takes half of the usual burn damage, rounded down.\",\"shortDesc\":\"Fire damage against this Pokemon is dealt with 1/2 offensive stat; 1/2 burn damage.\"},\"heavymetal\":{\"name\":\"Heavy Metal\",\"num\":134,\"desc\":\"This Pokemon's weight is doubled. This effect is calculated after the effect of Autotomize, and before the effect of Float Stone.\",\"shortDesc\":\"This Pokemon's weight is doubled.\"},\"honeygather\":{\"name\":\"Honey Gather\",\"num\":118,\"desc\":\"No competitive use.\",\"shortDesc\":\"No competitive use.\"},\"hospitality\":{\"name\":\"Hospitality\",\"num\":299,\"desc\":\"On switch-in, this Pokemon restores 1/4 of its ally's maximum HP, rounded down.\",\"shortDesc\":\"On switch-in, this Pokemon restores 1/4 of its ally's maximum HP, rounded down.\"},\"hugepower\":{\"name\":\"Huge Power\",\"num\":37,\"desc\":\"This Pokemon's Attack is doubled.\",\"shortDesc\":\"This Pokemon's Attack is doubled.\"},\"hungerswitch\":{\"name\":\"Hunger Switch\",\"num\":258,\"desc\":\"If this Pokemon is a Morpeko, it changes formes between its Full Belly Mode and Hangry Mode at the end of each turn.\",\"shortDesc\":\"If Morpeko, it changes between Full Belly and Hangry Mode at the end of each turn.\"},\"hustle\":{\"name\":\"Hustle\",\"num\":55,\"desc\":\"This Pokemon's Attack is multiplied by 1.5 and the accuracy of its physical attacks is multiplied by 0.8.\",\"shortDesc\":\"This Pokemon's Attack is 1.5x and accuracy of its physical attacks is 0.8x.\"},\"hydration\":{\"name\":\"Hydration\",\"num\":93,\"desc\":\"This Pokemon has its non-volatile status condition cured at the end of each turn if Rain Dance is active. This effect is prevented if this Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"This Pokemon has its status cured at the end of each turn if Rain Dance is active.\"},\"hypercutter\":{\"name\":\"Hyper Cutter\",\"num\":52,\"desc\":\"Prevents other Pokemon from lowering this Pokemon's Attack stat stage.\",\"shortDesc\":\"Prevents other Pokemon from lowering this Pokemon's Attack stat stage.\"},\"icebody\":{\"name\":\"Ice Body\",\"num\":115,\"desc\":\"If Snow is active, this Pokemon restores 1/16 of its maximum HP, rounded down, at the end of each turn.\",\"shortDesc\":\"If Snow is active, this Pokemon heals 1/16 of its max HP each turn.\"},\"iceface\":{\"name\":\"Ice Face\",\"num\":248,\"desc\":\"If this Pokemon is an Eiscue, the first physical hit it takes in battle deals 0 neutral damage. Its ice face is then broken and it changes forme to Noice Face. Eiscue regains its Ice Face forme when Snow begins or when Eiscue switches in while Snow is active. Confusion damage also breaks the ice face.\",\"shortDesc\":\"If Eiscue, the first physical hit it takes deals 0 damage. Effect is restored in Snow.\"},\"icescales\":{\"name\":\"Ice Scales\",\"num\":246,\"desc\":\"This Pokemon receives 1/2 damage from special attacks.\",\"shortDesc\":\"This Pokemon receives 1/2 damage from special attacks.\"},\"illuminate\":{\"name\":\"Illuminate\",\"num\":35,\"desc\":\"Prevents other Pokemon from lowering this Pokemon's accuracy stat stage. This Pokemon ignores a target's evasiveness stat stage.\",\"shortDesc\":\"This Pokemon's accuracy can't be lowered by others; ignores their evasiveness stat.\"},\"illusion\":{\"name\":\"Illusion\",\"num\":149,\"desc\":\"When this Pokemon switches in, it appears as the last unfainted Pokemon in its party until it takes direct damage from another Pokemon's attack. This Pokemon's actual level and HP are displayed instead of those of the mimicked Pokemon.\",\"shortDesc\":\"This Pokemon appears as the last Pokemon in the party until it takes direct damage.\"},\"immunity\":{\"name\":\"Immunity\",\"num\":17,\"desc\":\"This Pokemon cannot be poisoned. Gaining this Ability while poisoned cures it.\",\"shortDesc\":\"This Pokemon cannot be poisoned. Gaining this Ability while poisoned cures it.\"},\"imposter\":{\"name\":\"Imposter\",\"num\":150,\"desc\":\"On switch-in, this Pokemon Transforms into the opposing Pokemon that is facing it. If there is no Pokemon at that position, this Pokemon does not Transform.\",\"shortDesc\":\"On switch-in, this Pokemon Transforms into the opposing Pokemon that is facing it.\"},\"infiltrator\":{\"name\":\"Infiltrator\",\"num\":151,\"desc\":\"This Pokemon's moves ignore substitutes and the opposing side's Reflect, Light Screen, Safeguard, Mist, and Aurora Veil.\",\"shortDesc\":\"Moves ignore substitutes and foe's Reflect/Light Screen/Safeguard/Mist/Aurora Veil.\"},\"innardsout\":{\"name\":\"Innards Out\",\"num\":215,\"desc\":\"If this Pokemon is knocked out with a move, that move's user loses HP equal to the amount of damage inflicted on this Pokemon.\",\"shortDesc\":\"If this Pokemon is KOed with a move, that move's user loses an equal amount of HP.\"},\"innerfocus\":{\"name\":\"Inner Focus\",\"num\":39,\"desc\":\"This Pokemon cannot be made to flinch. This Pokemon is immune to the effect of the Intimidate Ability.\",\"shortDesc\":\"This Pokemon cannot be made to flinch. Immune to Intimidate.\"},\"insomnia\":{\"name\":\"Insomnia\",\"num\":15,\"desc\":\"This Pokemon cannot fall asleep. Gaining this Ability while asleep cures it.\",\"shortDesc\":\"This Pokemon cannot fall asleep. Gaining this Ability while asleep cures it.\"},\"intimidate\":{\"name\":\"Intimidate\",\"num\":22,\"desc\":\"On switch-in, this Pokemon lowers the Attack of opposing Pokemon by 1 stage. Pokemon with the Inner Focus, Oblivious, Own Tempo, or Scrappy Abilities and Pokemon behind a substitute are immune.\",\"shortDesc\":\"On switch-in, this Pokemon lowers the Attack of opponents by 1 stage.\"},\"intrepidsword\":{\"name\":\"Intrepid Sword\",\"num\":234,\"desc\":\"On switch-in, this Pokemon's Attack is raised by 1 stage. Once per battle.\",\"shortDesc\":\"On switch-in, this Pokemon's Attack is raised by 1 stage. Once per battle.\"},\"ironbarbs\":{\"name\":\"Iron Barbs\",\"num\":160,\"desc\":\"Pokemon making contact with this Pokemon lose 1/8 of their maximum HP, rounded down.\",\"shortDesc\":\"Pokemon making contact with this Pokemon lose 1/8 of their max HP.\"},\"ironfist\":{\"name\":\"Iron Fist\",\"num\":89,\"desc\":\"This Pokemon's punch-based attacks have their power multiplied by 1.2.\",\"shortDesc\":\"This Pokemon's punch-based attacks have 1.2x power. Sucker Punch is not boosted.\"},\"justified\":{\"name\":\"Justified\",\"num\":154,\"desc\":\"This Pokemon's Attack is raised by 1 stage after it is damaged by a Dark-type move.\",\"shortDesc\":\"This Pokemon's Attack is raised by 1 stage after it is damaged by a Dark-type move.\"},\"keeneye\":{\"name\":\"Keen Eye\",\"num\":51,\"desc\":\"Prevents other Pokemon from lowering this Pokemon's accuracy stat stage. This Pokemon ignores a target's evasiveness stat stage.\",\"shortDesc\":\"This Pokemon's accuracy can't be lowered by others; ignores their evasiveness stat.\"},\"klutz\":{\"name\":\"Klutz\",\"num\":103,\"desc\":\"This Pokemon's held item has no effect. This Pokemon cannot use Fling successfully. Macho Brace, Power Anklet, Power Band, Power Belt, Power Bracer, Power Lens, and Power Weight still have their effects.\",\"shortDesc\":\"This Pokemon's held item has no effect, except Macho Brace. Fling cannot be used.\"},\"leafguard\":{\"name\":\"Leaf Guard\",\"num\":102,\"desc\":\"If Sunny Day is active, this Pokemon cannot become affected by a non-volatile status condition or Yawn, and Rest will fail for it. This effect is prevented if this Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"If Sunny Day is active, this Pokemon cannot be statused and Rest will fail for it.\"},\"levitate\":{\"name\":\"Levitate\",\"num\":26,\"desc\":\"This Pokemon is immune to Ground-type attacks and the effects of Spikes, Toxic Spikes, Sticky Web, and the Arena Trap Ability. The effects of Gravity, Ingrain, Smack Down, Thousand Arrows, and Iron Ball nullify the immunity. Thousand Arrows can hit this Pokemon as if it did not have this Ability.\",\"shortDesc\":\"This Pokemon is immune to Ground; Gravity/Ingrain/Smack Down/Iron Ball nullify it.\"},\"libero\":{\"name\":\"Libero\",\"num\":236,\"desc\":\"This Pokemon's type changes to match the type of the move it is about to use. This effect comes after all effects that change a move's type. This effect can only happen once per switch-in, and only if this Pokemon is not Terastallized.\",\"shortDesc\":\"This Pokemon's type changes to the type of the move it is using. Once per switch-in.\"},\"lightmetal\":{\"name\":\"Light Metal\",\"num\":135,\"desc\":\"This Pokemon's weight is halved, rounded down to a tenth of a kilogram. This effect is calculated after the effect of Autotomize, and before the effect of Float Stone. A Pokemon's weight will not drop below 0.1 kg.\",\"shortDesc\":\"This Pokemon's weight is halved.\"},\"lightningrod\":{\"name\":\"Lightning Rod\",\"num\":31,\"desc\":\"This Pokemon is immune to Electric-type moves and raises its Special Attack by 1 stage when hit by an Electric-type move. If this Pokemon is not the target of a single-target Electric-type move used by another Pokemon, this Pokemon redirects that move to itself if it is within the range of that move. If multiple Pokemon could redirect with this Ability, it goes to the one with the highest Speed, or in the case of a tie to the one that has had this Ability active longer.\",\"shortDesc\":\"This Pokemon draws Electric moves to itself to raise Sp. Atk by 1; Electric immunity.\"},\"limber\":{\"name\":\"Limber\",\"num\":7,\"desc\":\"This Pokemon cannot be paralyzed. Gaining this Ability while paralyzed cures it.\",\"shortDesc\":\"This Pokemon cannot be paralyzed. Gaining this Ability while paralyzed cures it.\"},\"lingeringaroma\":{\"name\":\"Lingering Aroma\",\"num\":268,\"desc\":\"Pokemon making contact with this Pokemon have their Ability changed to Lingering Aroma. Does not affect Pokemon with the As One, Battle Bond, Comatose, Commander, Disguise, Gulp Missile, Hadron Engine, Ice Face, Lingering Aroma, Multitype, Orichalcum Pulse, Power Construct, Protosynthesis, Quark Drive, RKS System, Schooling, Shields Down, Stance Change, Zen Mode, or Zero to Hero Abilities.\",\"shortDesc\":\"Making contact with this Pokemon has the attacker's Ability become Lingering Aroma.\"},\"liquidooze\":{\"name\":\"Liquid Ooze\",\"num\":64,\"desc\":\"This Pokemon damages those draining HP from it for as much as they would heal.\",\"shortDesc\":\"This Pokemon damages those draining HP from it for as much as they would heal.\"},\"liquidvoice\":{\"name\":\"Liquid Voice\",\"num\":204,\"desc\":\"This Pokemon's sound-based moves become Water-type moves. This effect comes after other effects that change a move's type, but before Ion Deluge and Electrify's effects.\",\"shortDesc\":\"This Pokemon's sound-based moves become Water type.\"},\"longreach\":{\"name\":\"Long Reach\",\"num\":203,\"desc\":\"This Pokemon's attacks do not make contact with the target.\",\"shortDesc\":\"This Pokemon's attacks do not make contact with the target.\"},\"magicbounce\":{\"name\":\"Magic Bounce\",\"num\":156,\"desc\":\"This Pokemon is unaffected by certain non-damaging moves directed at it and will instead use such moves against the original user. Moves reflected in this way are unable to be reflected again by this or Magic Coat's effect. Spikes, Stealth Rock, Sticky Web, and Toxic Spikes can only be reflected once per side, by the leftmost Pokemon under this or Magic Coat's effect. The Lightning Rod and Storm Drain Abilities redirect their respective moves before this Ability takes effect.\",\"shortDesc\":\"This Pokemon blocks certain Status moves and bounces them back to the user.\"},\"magicguard\":{\"name\":\"Magic Guard\",\"num\":98,\"desc\":\"This Pokemon can only be damaged by direct attacks. Curse and Substitute on use, Belly Drum, Pain Split, Struggle recoil, and confusion damage are considered direct damage.\",\"shortDesc\":\"This Pokemon can only be damaged by direct attacks.\"},\"magician\":{\"name\":\"Magician\",\"num\":170,\"desc\":\"If this Pokemon has no item, it steals the item off a Pokemon it hits with an attack. Does not affect Doom Desire and Future Sight.\",\"shortDesc\":\"If this Pokemon has no item, it steals the item off a Pokemon it hits with an attack.\"},\"magmaarmor\":{\"name\":\"Magma Armor\",\"num\":40,\"desc\":\"This Pokemon cannot be frozen. Gaining this Ability while frozen cures it.\",\"shortDesc\":\"This Pokemon cannot be frozen. Gaining this Ability while frozen cures it.\"},\"magnetpull\":{\"name\":\"Magnet Pull\",\"num\":42,\"desc\":\"Prevents opposing Steel-type Pokemon from choosing to switch out, unless they are holding a Shed Shell or are a Ghost type.\",\"shortDesc\":\"Prevents opposing Steel-type Pokemon from choosing to switch out.\"},\"marvelscale\":{\"name\":\"Marvel Scale\",\"num\":63,\"desc\":\"If this Pokemon has a non-volatile status condition, its Defense is multiplied by 1.5.\",\"shortDesc\":\"If this Pokemon has a non-volatile status condition, its Defense is multiplied by 1.5.\"},\"megalauncher\":{\"name\":\"Mega Launcher\",\"num\":178,\"desc\":\"This Pokemon's aura, pulse, and cannon moves have their power multiplied by 1.5. Heal Pulse restores 3/4 of a target's maximum HP, rounded half down.\",\"shortDesc\":\"This Pokemon's aura, pulse, and cannon moves have 1.5x power. Heal Pulse heals 3/4 target's max HP.\"},\"merciless\":{\"name\":\"Merciless\",\"num\":196,\"desc\":\"This Pokemon's attacks are critical hits if the target is poisoned.\",\"shortDesc\":\"This Pokemon's attacks are critical hits if the target is poisoned.\"},\"mimicry\":{\"name\":\"Mimicry\",\"num\":250,\"desc\":\"This Pokemon's types change to match the active Terrain when this Pokemon acquires this Ability, or whenever a Terrain begins. Electric type during Electric Terrain, Grass type during Grassy Terrain, Fairy type during Misty Terrain, and Psychic type during Psychic Terrain. If this Ability is acquired without an active Terrain, or a Terrain ends, this Pokemon's types become the original types for its species.\",\"shortDesc\":\"This Pokemon's types change to match the Terrain. Type reverts when Terrain ends.\"},\"mindseye\":{\"name\":\"Mind's Eye\",\"num\":300,\"desc\":\"This Pokemon can hit Ghost types with Normal- and Fighting-type moves. Prevents other Pokemon from lowering this Pokemon's accuracy stat stage. This Pokemon ignores a target's evasiveness stat stage.\",\"shortDesc\":\"Fighting, Normal moves hit Ghost. Accuracy can't be lowered, ignores evasiveness.\"},\"minus\":{\"name\":\"Minus\",\"num\":58,\"desc\":\"If an active ally has this Ability or the Plus Ability, this Pokemon's Special Attack is multiplied by 1.5.\",\"shortDesc\":\"If an active ally has this Ability or the Plus Ability, this Pokemon's Sp. Atk is 1.5x.\"},\"mirrorarmor\":{\"name\":\"Mirror Armor\",\"num\":240,\"desc\":\"When one of this Pokemon's stat stages would be lowered by another Pokemon, that Pokemon's stat stage is lowered instead. This effect does not happen if this Pokemon's stat stage was already -6. If the other Pokemon has a substitute, neither Pokemon has its stat stage lowered.\",\"shortDesc\":\"If this Pokemon's stat stages would be lowered, the attacker's are lowered instead.\"},\"mistysurge\":{\"name\":\"Misty Surge\",\"num\":228,\"desc\":\"On switch-in, this Pokemon summons Misty Terrain.\",\"shortDesc\":\"On switch-in, this Pokemon summons Misty Terrain.\"},\"moldbreaker\":{\"name\":\"Mold Breaker\",\"num\":104,\"desc\":\"This Pokemon's moves and their effects ignore certain Abilities of other Pokemon. The Abilities that can be negated are Aroma Veil, Aura Break, Battle Armor, Big Pecks, Bulletproof, Clear Body, Contrary, Damp, Dazzling, Disguise, Dry Skin, Filter, Flash Fire, Flower Gift, Flower Veil, Fluffy, Friend Guard, Fur Coat, Grass Pelt, Heatproof, Heavy Metal, Hyper Cutter, Ice Face, Ice Scales, Immunity, Inner Focus, Insomnia, Keen Eye, Leaf Guard, Levitate, Light Metal, Lightning Rod, Limber, Magic Bounce, Magma Armor, Marvel Scale, Mirror Armor, Motor Drive, Multiscale, Oblivious, Overcoat, Own Tempo, Pastel Veil, Punk Rock, Regal Presence, Sand Veil, Sap Sipper, Shell Armor, Shield Dust, Simple, Snow Cloak, Solid Rock, Soundproof, Sticky Hold, Storm Drain, Sturdy, Suction Cups, Sweet Veil, Tangled Feet, Telepathy, Thick Fat, Unaware, Vital Spirit, Volt Absorb, Water Absorb, Water Bubble, Water Veil, White Smoke, Wonder Guard, and Wonder Skin. This affects every other Pokemon on the field, whether or not it is a target of this Pokemon's move, and whether or not their Ability is beneficial to this Pokemon.\",\"shortDesc\":\"This Pokemon's moves and their effects ignore the Abilities of other Pokemon.\"},\"moody\":{\"name\":\"Moody\",\"num\":141,\"desc\":\"This Pokemon has a random stat, other than accuracy or evasiveness, raised by 2 stages and another stat lowered by 1 stage at the end of each turn.\",\"shortDesc\":\"Boosts a random stat (except accuracy/evasion) +2 and another stat -1 every turn.\"},\"motordrive\":{\"name\":\"Motor Drive\",\"num\":78,\"desc\":\"This Pokemon is immune to Electric-type moves and raises its Speed by 1 stage when hit by an Electric-type move.\",\"shortDesc\":\"This Pokemon's Speed is raised 1 stage if hit by an Electric move; Electric immunity.\"},\"moxie\":{\"name\":\"Moxie\",\"num\":153,\"desc\":\"This Pokemon's Attack is raised by 1 stage if it attacks and knocks out another Pokemon.\",\"shortDesc\":\"This Pokemon's Attack is raised by 1 stage if it attacks and KOes another Pokemon.\"},\"multiscale\":{\"name\":\"Multiscale\",\"num\":136,\"desc\":\"If this Pokemon is at full HP, damage taken from attacks is halved.\",\"shortDesc\":\"If this Pokemon is at full HP, damage taken from attacks is halved.\"},\"multitype\":{\"name\":\"Multitype\",\"num\":121,\"desc\":\"If this Pokemon is an Arceus, its type changes to match its held Plate.\",\"shortDesc\":\"If this Pokemon is an Arceus, its type changes to match its held Plate.\"},\"mummy\":{\"name\":\"Mummy\",\"num\":152,\"desc\":\"Pokemon making contact with this Pokemon have their Ability changed to Mummy. Does not affect Pokemon with the As One, Battle Bond, Comatose, Commander, Disguise, Gulp Missile, Hadron Engine, Ice Face, Multitype, Mummy, Orichalcum Pulse, Power Construct, Protosynthesis, Quark Drive, RKS System, Schooling, Shields Down, Stance Change, Zen Mode, or Zero to Hero Abilities.\",\"shortDesc\":\"Pokemon making contact with this Pokemon have their Ability changed to Mummy.\"},\"myceliummight\":{\"name\":\"Mycelium Might\",\"num\":298,\"desc\":\"This Pokemon's Status moves ignore certain Abilities of other Pokemon, and go last among Pokemon using the same or greater priority moves.\",\"shortDesc\":\"This Pokemon's Status moves go last in their priority bracket and ignore Abilities.\"},\"naturalcure\":{\"name\":\"Natural Cure\",\"num\":30,\"desc\":\"This Pokemon has its non-volatile status condition cured when it switches out.\",\"shortDesc\":\"This Pokemon has its non-volatile status condition cured when it switches out.\"},\"neuroforce\":{\"name\":\"Neuroforce\",\"num\":233,\"desc\":\"This Pokemon's attacks that are super effective against the target have their damage multiplied by 1.25.\",\"shortDesc\":\"This Pokemon's attacks that are super effective against the target do 1.25x damage.\"},\"neutralizinggas\":{\"name\":\"Neutralizing Gas\",\"num\":256,\"desc\":\"While this Pokemon is active, Abilities have no effect. This Ability activates before hazards and other Abilities take effect. Does not affect the As One, Battle Bond, Comatose, Disguise, Gulp Missile, Ice Face, Multitype, Power Construct, Protosynthesis, Quark Drive, RKS System, Schooling, Shields Down, Stance Change, Zen Mode or Zero to Hero Abilities.\",\"shortDesc\":\"While this Pokemon is active, Abilities have no effect.\"},\"noguard\":{\"name\":\"No Guard\",\"num\":99,\"desc\":\"Every move used by or against this Pokemon will always hit.\",\"shortDesc\":\"Every move used by or against this Pokemon will always hit.\"},\"normalize\":{\"name\":\"Normalize\",\"num\":96,\"desc\":\"This Pokemon's moves are changed to be Normal type and have their power multiplied by 1.2. This effect comes before other effects that change a move's type.\",\"shortDesc\":\"This Pokemon's moves are changed to be Normal type and have 1.2x power.\"},\"oblivious\":{\"name\":\"Oblivious\",\"num\":12,\"desc\":\"This Pokemon cannot be infatuated or taunted. Gaining this Ability while infatuated or taunted cures it. This Pokemon is immune to the effect of the Intimidate Ability.\",\"shortDesc\":\"This Pokemon cannot be infatuated or taunted. Immune to Intimidate.\"},\"opportunist\":{\"name\":\"Opportunist\",\"num\":290,\"desc\":\"When an opposing Pokemon has a stat stage raised, this Pokemon copies the effect.\",\"shortDesc\":\"When an opposing Pokemon has a stat stage raised, this Pokemon copies the effect.\"},\"orichalcumpulse\":{\"name\":\"Orichalcum Pulse\",\"num\":288,\"desc\":\"On switch-in, summons Sunny Day. During Sunny Day, Attack is 1.3333x.\",\"shortDesc\":\"On switch-in, summons Sunny Day. During Sunny Day, Attack is 1.3333x.\"},\"overcoat\":{\"name\":\"Overcoat\",\"num\":142,\"desc\":\"This Pokemon is immune to powder moves, damage from Sandstorm, and the effects of Rage Powder and the Effect Spore Ability.\",\"shortDesc\":\"This Pokemon is immune to powder moves, Sandstorm damage, and Effect Spore.\"},\"overgrow\":{\"name\":\"Overgrow\",\"num\":65,\"desc\":\"When this Pokemon has 1/3 or less of its maximum HP, rounded down, its offensive stat is multiplied by 1.5 while using a Grass-type attack.\",\"shortDesc\":\"At 1/3 or less of its max HP, this Pokemon's offensive stat is 1.5x with Grass attacks.\"},\"owntempo\":{\"name\":\"Own Tempo\",\"num\":20,\"desc\":\"This Pokemon cannot be confused. Gaining this Ability while confused cures it. This Pokemon is immune to the effect of the Intimidate Ability.\",\"shortDesc\":\"This Pokemon cannot be confused. Immune to Intimidate.\"},\"multistriker\":{\"name\":\"Multistriker\",\"num\":185,\"desc\":\"This Pokemon's damaging moves become multi-hit moves that hit twice. The second hit has its damage quartered. Does not affect Doom Desire, Dragon Darts, Dynamax Cannon, Endeavor, Explosion, Final Gambit, Fling, Future Sight, Ice Ball, Rollout, Self-Destruct, any multi-hit move, any move that has multiple targets, or any two-turn move.\",\"shortDesc\":\"This Pokemon's damaging moves hit twice. The second hit has its damage quartered.\"},\"pastelveil\":{\"name\":\"Pastel Veil\",\"num\":257,\"desc\":\"This Pokemon and its allies cannot be poisoned. Gaining this Ability while this Pokemon or its ally is poisoned cures them. If this Ability is being ignored during an effect that causes poison, this Pokemon is cured immediately but its ally is not.\",\"shortDesc\":\"This Pokemon and its allies cannot be poisoned. On switch-in, cures poisoned allies.\"},\"perishbody\":{\"name\":\"Perish Body\",\"num\":253,\"desc\":\"Making contact with this Pokemon starts the Perish Song effect for it and the attacker. This effect does not happen for this Pokemon if the attacker already has a perish count.\",\"shortDesc\":\"Making contact with this Pokemon starts the Perish Song effect for it and the attacker.\"},\"pickpocket\":{\"name\":\"Pickpocket\",\"num\":124,\"desc\":\"If this Pokemon has no item and is hit by a contact move, it steals the attacker's item. This effect applies after all hits from a multi-hit move. This effect is prevented if the move had a secondary effect removed by the Sheer Force Ability.\",\"shortDesc\":\"If this Pokemon has no item and is hit by a contact move, it steals the attacker's item.\"},\"pickup\":{\"name\":\"Pickup\",\"num\":53,\"desc\":\"If this Pokemon has no item, it finds one used by an adjacent Pokemon this turn.\",\"shortDesc\":\"If this Pokemon has no item, it finds one used by an adjacent Pokemon this turn.\"},\"pixilate\":{\"name\":\"Pixilate\",\"num\":182,\"desc\":\"This Pokemon's Normal-type moves become Fairy-type moves and have their power multiplied by 1.2. This effect comes after other effects that change a move's type, but before Ion Deluge and Electrify's effects.\",\"shortDesc\":\"This Pokemon's Normal-type moves become Fairy type and have 1.2x power.\"},\"plus\":{\"name\":\"Plus\",\"num\":57,\"desc\":\"If an active ally has this Ability or the Minus Ability, this Pokemon's Special Attack is multiplied by 1.5.\",\"shortDesc\":\"If an active ally has this Ability or the Minus Ability, this Pokemon's Sp. Atk is 1.5x.\"},\"poisonheal\":{\"name\":\"Poison Heal\",\"num\":90,\"desc\":\"If this Pokemon is poisoned, it restores 1/8 of its maximum HP, rounded down, at the end of each turn instead of losing HP.\",\"shortDesc\":\"This Pokemon is healed by 1/8 of its max HP each turn when poisoned; no HP loss.\"},\"poisonpoint\":{\"name\":\"Poison Point\",\"num\":38,\"desc\":\"30% chance a Pokemon making contact with this Pokemon will be poisoned.\",\"shortDesc\":\"30% chance a Pokemon making contact with this Pokemon will be poisoned.\"},\"poisontouch\":{\"name\":\"Poison Touch\",\"num\":143,\"desc\":\"This Pokemon's contact moves have a 30% chance of poisoning. This effect comes after a move's inherent secondary effect chance.\",\"shortDesc\":\"This Pokemon's contact moves have a 30% chance of poisoning.\"},\"powerconstruct\":{\"name\":\"Power Construct\",\"num\":211,\"desc\":\"If this Pokemon is a Zygarde in its 10% or 50% Forme, it changes to Complete Forme when it has 1/2 or less of its maximum HP at the end of the turn.\",\"shortDesc\":\"If Zygarde 10%/50%, changes to Complete if at 1/2 max HP or less at end of turn.\"},\"powerofalchemy\":{\"name\":\"Power of Alchemy\",\"num\":223,\"desc\":\"This Pokemon copies the Ability of an ally that faints. Abilities that cannot be copied are As One, Battle Bond, Comatose, Commander, Disguise, Flower Gift, Forecast, Gulp Missile, Hadron Engine, Hunger Switch, Ice Face, Illusion, Imposter, Multitype, Neutralizing Gas, Orichalcum Pulse, Power Construct, Power of Alchemy, Protosynthesis, Quark Drive, Receiver, RKS System, Schooling, Shields Down, Stance Change, Trace, Wonder Guard, Zen Mode, and Zero to Hero.\",\"shortDesc\":\"This Pokemon copies the Ability of an ally that faints.\"},\"powerspot\":{\"name\":\"Power Spot\",\"num\":249,\"desc\":\"This Pokemon's allies have the power of their moves multiplied by 1.3. This affects Doom Desire and Future Sight, even if the user is not on the field.\",\"shortDesc\":\"This Pokemon's allies have the power of their moves multiplied by 1.3.\"},\"prankster\":{\"name\":\"Prankster\",\"num\":158,\"desc\":\"This Pokemon's non-damaging moves have their priority increased by 1. Opposing Dark-type Pokemon are immune to these moves, and any move called by these moves, if the resulting user of the move has this Ability.\",\"shortDesc\":\"This Pokemon's Status moves have priority raised by 1, but Dark types are immune.\"},\"pressure\":{\"name\":\"Pressure\",\"num\":46,\"desc\":\"If this Pokemon is the target of an opposing Pokemon's move, that move loses one additional PP. Imprison, Snatch, and Tera Blast also lose one additional PP when used by an opposing Pokemon, but Sticky Web does not.\",\"shortDesc\":\"If this Pokemon is the target of a foe's move, that move loses one additional PP.\"},\"primordialsea\":{\"name\":\"Primordial Sea\",\"num\":189,\"desc\":\"On switch-in, the weather becomes Primordial Sea, which includes all the effects of Rain Dance and prevents damaging Fire-type moves from executing. This weather remains in effect until this Ability is no longer active for any Pokemon, or the weather is changed by the Delta Stream or Desolate Land Abilities.\",\"shortDesc\":\"On switch-in, heavy rain begins until this Ability is not active in battle.\"},\"prismarmor\":{\"name\":\"Prism Armor\",\"num\":232,\"desc\":\"This Pokemon receives 3/4 damage from supereffective attacks.\",\"shortDesc\":\"This Pokemon receives 3/4 damage from supereffective attacks.\"},\"propellertail\":{\"name\":\"Propeller Tail\",\"num\":239,\"desc\":\"This Pokemon's moves cannot be redirected to a different target by any effect.\",\"shortDesc\":\"This Pokemon's moves cannot be redirected to a different target by any effect.\"},\"protean\":{\"name\":\"Protean\",\"num\":168,\"desc\":\"This Pokemon's type changes to match the type of the move it is about to use. This effect comes after all effects that change a move's type. This effect can only happen once per switch-in, and only if this Pokemon is not Terastallized.\",\"shortDesc\":\"This Pokemon's type changes to the type of the move it is using. Once per switch-in.\"},\"protosynthesis\":{\"name\":\"Protosynthesis\",\"num\":281,\"desc\":\"If Sunny Day is active or this Pokemon uses a held Booster Energy, this Pokemon's highest stat is multiplied by 1.3, or by 1.5 if the highest stat is Speed. Stat stage changes are considered at the time this Ability activates. If multiple stats are tied, Attack, Defense, Special Attack, Special Defense, and Speed are prioritized in that order. If this effect was started by Sunny Day, a held Booster Energy will not activate and the effect ends when Sunny Day is no longer active. If this effect was started by a held Booster Energy, it ends when this Pokemon is no longer active.\",\"shortDesc\":\"Sunny Day active or Booster Energy used: highest stat is 1.3x, or 1.5x if Speed.\"},\"psychicsurge\":{\"name\":\"Psychic Surge\",\"num\":227,\"desc\":\"On switch-in, this Pokemon summons Psychic Terrain.\",\"shortDesc\":\"On switch-in, this Pokemon summons Psychic Terrain.\"},\"punkrock\":{\"name\":\"Punk Rock\",\"num\":244,\"desc\":\"This Pokemon's sound-based moves have their power multiplied by 1.3. This Pokemon takes halved damage from sound-based moves.\",\"shortDesc\":\"This Pokemon receives 1/2 damage from sound moves. Its own have 1.3x power.\"},\"purepower\":{\"name\":\"Pure Power\",\"num\":74,\"desc\":\"This Pokemon's Attack is doubled.\",\"shortDesc\":\"This Pokemon's Attack is doubled.\"},\"purifyingsalt\":{\"name\":\"Purifying Salt\",\"num\":272,\"desc\":\"This Pokemon cannot become affected by a non-volatile status condition or Yawn. If a Pokemon uses a Ghost-type attack against this Pokemon, that Pokemon's offensive stat is halved when calculating the damage to this Pokemon.\",\"shortDesc\":\"Ghost damage to this Pokemon dealt with a halved offensive stat; can't be statused.\"},\"quarkdrive\":{\"name\":\"Quark Drive\",\"num\":282,\"desc\":\"If Electric Terrain is active or this Pokemon uses a held Booster Energy, this Pokemon's highest stat is multiplied by 1.3, or by 1.5 if the highest stat is Speed. Stat stage changes are considered at the time this Ability activates. If multiple stats are tied, Attack, Defense, Special Attack, Special Defense, and Speed are prioritized in that order. If this effect was started by Electric Terrain, a held Booster Energy will not activate and the effect ends when Electric Terrain is no longer active. If this effect was started by a held Booster Energy, it ends when this Pokemon is no longer active.\",\"shortDesc\":\"Electric Terrain active or Booster Energy used: highest stat is 1.3x, or 1.5x if Speed.\"},\"regalpresence\":{\"name\":\"Regal Presence\",\"num\":214,\"desc\":\"Priority moves used by opposing Pokemon targeting this Pokemon or its allies are prevented from having an effect.\",\"shortDesc\":\"This Pokemon and its allies are protected from opposing priority moves.\"},\"quickdraw\":{\"name\":\"Quick Draw\",\"num\":259,\"desc\":\"This Pokemon has a 30% chance to move first in its priority bracket with attacking moves.\",\"shortDesc\":\"This Pokemon has a 30% chance to move first in its priority bracket with attacking moves.\"},\"quickfeet\":{\"name\":\"Quick Feet\",\"num\":95,\"desc\":\"If this Pokemon has a non-volatile status condition, its Speed is multiplied by 1.5. This Pokemon ignores the paralysis effect of halving Speed.\",\"shortDesc\":\"If this Pokemon is statused, its Speed is 1.5x; ignores Speed drop from paralysis.\"},\"raindish\":{\"name\":\"Rain Dish\",\"num\":44,\"desc\":\"If Rain Dance is active, this Pokemon restores 1/16 of its maximum HP, rounded down, at the end of each turn. This effect is prevented if this Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"If Rain Dance is active, this Pokemon heals 1/16 of its max HP each turn.\"},\"rattled\":{\"name\":\"Rattled\",\"num\":155,\"desc\":\"This Pokemon's Speed is raised by 1 stage if hit by a Bug-, Dark-, or Ghost-type attack, or if an opposing Pokemon affected this Pokemon with the Intimidate Ability.\",\"shortDesc\":\"Speed is raised 1 stage if hit by a Bug-, Dark-, or Ghost-type attack, or Intimidated.\"},\"receiver\":{\"name\":\"Receiver\",\"num\":222,\"desc\":\"This Pokemon copies the Ability of an ally that faints. Abilities that cannot be copied are As One, Battle Bond, Comatose, Commander, Disguise, Flower Gift, Forecast, Gulp Missile, Hadron Engine, Hunger Switch, Ice Face, Illusion, Imposter, Multitype, Neutralizing Gas, Orichalcum Pulse, Power Construct, Power of Alchemy, Protosynthesis, Quark Drive, Receiver, RKS System, Schooling, Shields Down, Stance Change, Trace, Wonder Guard, Zen Mode, and Zero to Hero.\",\"shortDesc\":\"This Pokemon copies the Ability of an ally that faints.\"},\"reckless\":{\"name\":\"Reckless\",\"num\":120,\"desc\":\"This Pokemon's attacks with recoil or crash damage have their power multiplied by 1.2. Does not affect Struggle.\",\"shortDesc\":\"This Pokemon's attacks with recoil or crash damage have 1.2x power; not Struggle.\"},\"refrigerate\":{\"name\":\"Refrigerate\",\"num\":174,\"desc\":\"This Pokemon's Normal-type moves become Ice-type moves and have their power multiplied by 1.2. This effect comes after other effects that change a move's type, but before Ion Deluge and Electrify's effects.\",\"shortDesc\":\"This Pokemon's Normal-type moves become Ice type and have 1.2x power.\"},\"regenerator\":{\"name\":\"Regenerator\",\"num\":144,\"desc\":\"This Pokemon restores 1/3 of its maximum HP, rounded down, when it switches out.\",\"shortDesc\":\"This Pokemon restores 1/3 of its maximum HP, rounded down, when it switches out.\"},\"ripen\":{\"name\":\"Ripen\",\"num\":247,\"desc\":\"When this Pokemon eats certain Berries, the effects are doubled. Berries that restore HP or PP have the amount doubled, Berries that raise stat stages have the amount doubled, Berries that halve damage taken quarter it instead, and a Jaboca Berry or Rowap Berry has the attacker lose 1/4 of its maximum HP, rounded down.\",\"shortDesc\":\"When this Pokemon eats certain Berries, the effects are doubled.\"},\"rivalry\":{\"name\":\"Rivalry\",\"num\":79,\"desc\":\"This Pokemon's attacks have their power multiplied by 1.25 against targets of the same gender or multiplied by 0.75 against targets of the opposite gender. There is no modifier if either this Pokemon or the target is genderless.\",\"shortDesc\":\"This Pokemon's attacks do 1.25x on same gender targets; 0.75x on opposite gender.\"},\"rkssystem\":{\"name\":\"RKS System\",\"num\":225,\"desc\":\"If this Pokemon is a Silvally, its type changes to match its held Memory.\",\"shortDesc\":\"If this Pokemon is a Silvally, its type changes to match its held Memory.\"},\"rockhead\":{\"name\":\"Rock Head\",\"num\":69,\"desc\":\"This Pokemon does not take recoil damage, except Struggle. Does not affect Life Orb damage or crash damage.\",\"shortDesc\":\"This Pokemon does not take recoil damage besides Struggle/Life Orb/crash damage.\"},\"rockypayload\":{\"name\":\"Rocky Payload\",\"num\":276,\"desc\":\"This Pokemon's offensive stat is multiplied by 1.5 while using a Rock-type attack.\",\"shortDesc\":\"This Pokemon's offensive stat is multiplied by 1.5 while using a Rock-type attack.\"},\"roughskin\":{\"name\":\"Rough Skin\",\"num\":24,\"desc\":\"Pokemon making contact with this Pokemon lose 1/8 of their maximum HP, rounded down.\",\"shortDesc\":\"Pokemon making contact with this Pokemon lose 1/8 of their max HP.\"},\"runaway\":{\"name\":\"Run Away\",\"num\":50,\"desc\":\"No competitive use.\",\"shortDesc\":\"No competitive use.\"},\"sandforce\":{\"name\":\"Sand Force\",\"num\":159,\"desc\":\"If Sandstorm is active, this Pokemon's Ground-, Rock-, and Steel-type attacks have their power multiplied by 1.3. This Pokemon takes no damage from Sandstorm.\",\"shortDesc\":\"This Pokemon's Ground/Rock/Steel attacks do 1.3x in Sandstorm; immunity to it.\"},\"sandrush\":{\"name\":\"Sand Rush\",\"num\":146,\"desc\":\"If Sandstorm is active, this Pokemon's Speed is doubled. This Pokemon takes no damage from Sandstorm.\",\"shortDesc\":\"If Sandstorm is active, this Pokemon's Speed is doubled; immunity to Sandstorm.\"},\"sandspit\":{\"name\":\"Sand Spit\",\"num\":245,\"desc\":\"When this Pokemon is hit by an attack, the effect of Sandstorm begins.\",\"shortDesc\":\"When this Pokemon is hit by an attack, the effect of Sandstorm begins.\"},\"sandstream\":{\"name\":\"Sand Stream\",\"num\":45,\"desc\":\"On switch-in, this Pokemon summons Sandstorm.\",\"shortDesc\":\"On switch-in, this Pokemon summons Sandstorm.\"},\"sandveil\":{\"name\":\"Sand Veil\",\"num\":8,\"desc\":\"If Sandstorm is active, the accuracy of moves used against this Pokemon is multiplied by 0.8. This Pokemon takes no damage from Sandstorm.\",\"shortDesc\":\"If Sandstorm is active, this Pokemon's evasiveness is 1.25x; immunity to Sandstorm.\"},\"sapsipper\":{\"name\":\"Sap Sipper\",\"num\":157,\"desc\":\"This Pokemon is immune to Grass-type moves and raises its Attack by 1 stage when hit by a Grass-type move.\",\"shortDesc\":\"This Pokemon's Attack is raised 1 stage if hit by a Grass move; Grass immunity.\"},\"schooling\":{\"name\":\"Schooling\",\"num\":208,\"desc\":\"On switch-in, if this Pokemon is a Wishiwashi that is level 20 or above and has more than 1/4 of its maximum HP left, it changes to School Form. If it is in School Form and its HP drops to 1/4 of its maximum HP or less, it changes to Solo Form at the end of the turn. If it is in Solo Form and its HP is greater than 1/4 its maximum HP at the end of the turn, it changes to School Form.\",\"shortDesc\":\"If user is Wishiwashi, changes to School Form if it has > 1/4 max HP, else Solo Form.\"},\"scrappy\":{\"name\":\"Scrappy\",\"num\":113,\"desc\":\"This Pokemon can hit Ghost types with Normal- and Fighting-type moves. This Pokemon is immune to the effect of the Intimidate Ability.\",\"shortDesc\":\"Fighting, Normal moves hit Ghost. Immune to Intimidate.\"},\"screencleaner\":{\"name\":\"Screen Cleaner\",\"num\":251,\"desc\":\"On switch-in, the effects of Aurora Veil, Light Screen, and Reflect end for both sides.\",\"shortDesc\":\"On switch-in, the effects of Aurora Veil, Light Screen, and Reflect end for both sides.\"},\"seedsower\":{\"name\":\"Seed Sower\",\"num\":269,\"desc\":\"When this Pokemon is hit by an attack, the effect of Grassy Terrain begins.\",\"shortDesc\":\"When this Pokemon is hit by an attack, the effect of Grassy Terrain begins.\"},\"serenegrace\":{\"name\":\"Serene Grace\",\"num\":32,\"desc\":\"This Pokemon's moves have their secondary effect chance doubled. This effect stacks with the Rainbow effect, except for secondary effects that cause the target to flinch.\",\"shortDesc\":\"This Pokemon's moves have their secondary effect chance doubled.\"},\"shadowshield\":{\"name\":\"Shadow Shield\",\"num\":231,\"desc\":\"If this Pokemon is at full HP, damage taken from attacks is halved.\",\"shortDesc\":\"If this Pokemon is at full HP, damage taken from attacks is halved.\"},\"shadowtag\":{\"name\":\"Shadow Tag\",\"num\":23,\"desc\":\"Prevents opposing Pokemon from choosing to switch out, unless they are holding a Shed Shell, are a Ghost type, or also have this Ability.\",\"shortDesc\":\"Prevents foes from choosing to switch unless they also have this Ability.\"},\"sharpness\":{\"name\":\"Sharpness\",\"num\":292,\"desc\":\"This Pokemon's slicing moves have their power multiplied by 1.5.\",\"shortDesc\":\"This Pokemon's slicing moves have their power multiplied by 1.5.\"},\"shedskin\":{\"name\":\"Shed Skin\",\"num\":61,\"desc\":\"This Pokemon has a 33% chance to have its non-volatile status condition cured at the end of each turn.\",\"shortDesc\":\"This Pokemon has a 33% chance to have its status cured at the end of each turn.\"},\"sheerforce\":{\"name\":\"Sheer Force\",\"num\":125,\"desc\":\"This Pokemon's attacks with secondary effects have their power multiplied by 1.3, but the secondary effects are removed. If a secondary effect was removed, it also removes the user's Life Orb recoil and Shell Bell recovery, and prevents the target's Anger Shell, Berserk, Color Change, Emergency Exit, Pickpocket, Wimp Out, Red Card, Eject Button, Kee Berry, and Maranga Berry from activating.\",\"shortDesc\":\"This Pokemon's attacks with secondary effects have 1.3x power; nullifies the effects.\"},\"shellarmor\":{\"name\":\"Shell Armor\",\"num\":75,\"desc\":\"This Pokemon cannot be struck by a critical hit.\",\"shortDesc\":\"This Pokemon cannot be struck by a critical hit.\"},\"shielddust\":{\"name\":\"Shield Dust\",\"num\":19,\"desc\":\"This Pokemon is not affected by the secondary effect of another Pokemon's attack.\",\"shortDesc\":\"This Pokemon is not affected by the secondary effect of another Pokemon's attack.\"},\"shieldsdown\":{\"name\":\"Shields Down\",\"num\":197,\"desc\":\"If this Pokemon is a Minior, it changes to its Core forme if it has 1/2 or less of its maximum HP, and changes to Meteor Form if it has more than 1/2 its maximum HP. This check is done on switch-in and at the end of each turn. While in its Meteor Form, it cannot become affected by a non-volatile status condition or Yawn.\",\"shortDesc\":\"If Minior, switch-in/end of turn it changes to Core at 1/2 max HP or less, else Meteor.\"},\"simple\":{\"name\":\"Simple\",\"num\":86,\"desc\":\"When one of this Pokemon's stat stages is raised or lowered, the amount is doubled.\",\"shortDesc\":\"When one of this Pokemon's stat stages is raised or lowered, the amount is doubled.\"},\"skilllink\":{\"name\":\"Skill Link\",\"num\":92,\"desc\":\"This Pokemon's multi-hit attacks always hit the maximum number of times. Triple Kick and Triple Axel do not check accuracy for the second and third hits.\",\"shortDesc\":\"This Pokemon's multi-hit attacks always hit the maximum number of times.\"},\"slowstart\":{\"name\":\"Slow Start\",\"num\":112,\"desc\":\"On switch-in, this Pokemon's Attack and Speed are halved for 5 turns.\",\"shortDesc\":\"On switch-in, this Pokemon's Attack and Speed are halved for 5 turns.\"},\"slushrush\":{\"name\":\"Slush Rush\",\"num\":202,\"desc\":\"If Snow is active, this Pokemon's Speed is doubled.\",\"shortDesc\":\"If Snow is active, this Pokemon's Speed is doubled.\"},\"sniper\":{\"name\":\"Sniper\",\"num\":97,\"desc\":\"If this Pokemon strikes with a critical hit, the damage is multiplied by 1.5.\",\"shortDesc\":\"If this Pokemon strikes with a critical hit, the damage is multiplied by 1.5.\"},\"snowcloak\":{\"name\":\"Snow Cloak\",\"num\":81,\"desc\":\"If Snow is active, the accuracy of moves used against this Pokemon is multiplied by 0.8.\",\"shortDesc\":\"If Snow is active, this Pokemon's evasiveness is 1.25x.\"},\"snowwarning\":{\"name\":\"Snow Warning\",\"num\":117,\"desc\":\"On switch-in, this Pokemon summons Snow.\",\"shortDesc\":\"On switch-in, this Pokemon summons Snow.\"},\"solarpower\":{\"name\":\"Solar Power\",\"num\":94,\"desc\":\"If Sunny Day is active, this Pokemon's Special Attack is multiplied by 1.5 and it loses 1/8 of its maximum HP, rounded down, at the end of each turn. These effects are prevented if the Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"If Sunny Day is active, this Pokemon's Sp. Atk is 1.5x; loses 1/8 max HP per turn.\"},\"solidrock\":{\"name\":\"Solid Rock\",\"num\":116,\"desc\":\"This Pokemon receives 3/4 damage from supereffective attacks.\",\"shortDesc\":\"This Pokemon receives 3/4 damage from supereffective attacks.\"},\"soulheart\":{\"name\":\"Soul-Heart\",\"num\":220,\"desc\":\"This Pokemon's Special Attack is raised by 1 stage when another Pokemon faints.\",\"shortDesc\":\"This Pokemon's Special Attack is raised by 1 stage when another Pokemon faints.\"},\"soundproof\":{\"name\":\"Soundproof\",\"num\":43,\"desc\":\"This Pokemon is immune to sound-based moves, unless it used the move.\",\"shortDesc\":\"This Pokemon is immune to sound-based moves, unless it used the move.\"},\"speedboost\":{\"name\":\"Speed Boost\",\"num\":3,\"desc\":\"This Pokemon's Speed is raised by 1 stage at the end of each full turn it has been on the field.\",\"shortDesc\":\"This Pokemon's Speed is raised 1 stage at the end of each full turn on the field.\"},\"stakeout\":{\"name\":\"Stakeout\",\"num\":198,\"desc\":\"This Pokemon's offensive stat is doubled against a target that switched in this turn.\",\"shortDesc\":\"This Pokemon's offensive stat is doubled against a target that switched in this turn.\"},\"stall\":{\"name\":\"Stall\",\"num\":100,\"desc\":\"This Pokemon moves last among Pokemon using the same or greater priority moves.\",\"shortDesc\":\"This Pokemon moves last among Pokemon using the same or greater priority moves.\"},\"stalwart\":{\"name\":\"Stalwart\",\"num\":242,\"desc\":\"This Pokemon's moves cannot be redirected to a different target by any effect.\",\"shortDesc\":\"This Pokemon's moves cannot be redirected to a different target by any effect.\"},\"stamina\":{\"name\":\"Stamina\",\"num\":192,\"desc\":\"This Pokemon's Defense is raised by 1 stage after it is damaged by a move.\",\"shortDesc\":\"This Pokemon's Defense is raised by 1 stage after it is damaged by a move.\"},\"stancechange\":{\"name\":\"Stance Change\",\"num\":176,\"desc\":\"If this Pokemon is an Aegislash, it changes to Blade Forme before using an attacking move, and changes to Shield Forme before using King's Shield.\",\"shortDesc\":\"If Aegislash, changes Forme to Blade before attacks and Shield before King's Shield.\"},\"static\":{\"name\":\"Static\",\"num\":9,\"desc\":\"30% chance a Pokemon making contact with this Pokemon will be paralyzed.\",\"shortDesc\":\"30% chance a Pokemon making contact with this Pokemon will be paralyzed.\"},\"steadfast\":{\"name\":\"Steadfast\",\"num\":80,\"desc\":\"If this Pokemon flinches, its Speed is raised by 1 stage.\",\"shortDesc\":\"If this Pokemon flinches, its Speed is raised by 1 stage.\"},\"steamengine\":{\"name\":\"Steam Engine\",\"num\":243,\"desc\":\"This Pokemon's Speed is raised by 6 stages after it is damaged by a Fire- or Water-type move.\",\"shortDesc\":\"This Pokemon's Speed is raised by 6 stages after it is damaged by Fire/Water moves.\"},\"steelworker\":{\"name\":\"Steelworker\",\"num\":200,\"desc\":\"This Pokemon's offensive stat is multiplied by 1.5 while using a Steel-type attack.\",\"shortDesc\":\"This Pokemon's offensive stat is multiplied by 1.5 while using a Steel-type attack.\"},\"steelyspirit\":{\"name\":\"Steely Spirit\",\"num\":252,\"desc\":\"This Pokemon and its allies' Steel-type moves have their power multiplied by 1.5. This affects Doom Desire even if the user is not on the field.\",\"shortDesc\":\"This Pokemon and its allies' Steel-type moves have their power multiplied by 1.5.\"},\"stench\":{\"name\":\"Stench\",\"num\":1,\"desc\":\"This Pokemon's attacks without a chance to make the target flinch gain a 10% chance to make the target flinch.\",\"shortDesc\":\"This Pokemon's attacks without a chance to flinch gain a 10% chance to flinch.\"},\"stickyhold\":{\"name\":\"Sticky Hold\",\"num\":60,\"desc\":\"This Pokemon cannot lose its held item due to another Pokemon's Ability or attack, unless the attack knocks out this Pokemon. A Sticky Barb will be transferred to other Pokemon regardless of this Ability.\",\"shortDesc\":\"This Pokemon cannot lose its held item due to another Pokemon's Ability or attack.\"},\"stormdrain\":{\"name\":\"Storm Drain\",\"num\":114,\"desc\":\"This Pokemon is immune to Water-type moves and raises its Special Attack by 1 stage when hit by a Water-type move. If this Pokemon is not the target of a single-target Water-type move used by another Pokemon, this Pokemon redirects that move to itself if it is within the range of that move. If multiple Pokemon could redirect with this Ability, it goes to the one with the highest Speed, or in the case of a tie to the one that has had this Ability active longer.\",\"shortDesc\":\"This Pokemon draws Water moves to itself to raise Sp. Atk by 1; Water immunity.\"},\"strongjaw\":{\"name\":\"Strong Jaw\",\"num\":173,\"desc\":\"This Pokemon's bite-based attacks have their power multiplied by 1.5.\",\"shortDesc\":\"This Pokemon's bite-based attacks have 1.5x power. Bug Bite is not boosted.\"},\"sturdy\":{\"name\":\"Sturdy\",\"num\":5,\"desc\":\"If this Pokemon is at full HP, it survives one hit with at least 1 HP. OHKO moves fail when used against this Pokemon.\",\"shortDesc\":\"If this Pokemon is at full HP, it survives one hit with at least 1 HP. Immune to OHKO.\"},\"suctioncups\":{\"name\":\"Suction Cups\",\"num\":21,\"desc\":\"This Pokemon cannot be forced to switch out by another Pokemon's attack or item.\",\"shortDesc\":\"This Pokemon cannot be forced to switch out by another Pokemon's attack or item.\"},\"superluck\":{\"name\":\"Super Luck\",\"num\":105,\"desc\":\"This Pokemon's critical hit ratio is raised by 1 stage.\",\"shortDesc\":\"This Pokemon's critical hit ratio is raised by 1 stage.\"},\"supersweetsyrup\":{\"name\":\"Supersweet Syrup\",\"num\":306,\"desc\":\"On switch-in, this Pokemon lowers the evasiveness of opponents 1 stage. Once per battle.\",\"shortDesc\":\"On switch-in, this Pokemon lowers the evasiveness of opponents 1 stage. Once per battle.\"},\"supremeoverlord\":{\"name\":\"Supreme Overlord\",\"num\":293,\"desc\":\"This Pokemon's moves have their power multiplied by 1+(X*0.1), where X is the total number of times any Pokemon has fainted on the user's side when this Ability became active, and X cannot be greater than 5.\",\"shortDesc\":\"This Pokemon's moves have 10% more power for each fainted ally, up to 5 allies.\"},\"surgesurfer\":{\"name\":\"Surge Surfer\",\"num\":207,\"desc\":\"If Electric Terrain is active, this Pokemon's Speed is doubled.\",\"shortDesc\":\"If Electric Terrain is active, this Pokemon's Speed is doubled.\"},\"swarm\":{\"name\":\"Swarm\",\"num\":68,\"desc\":\"When this Pokemon has 1/3 or less of its maximum HP, rounded down, its offensive stat is multiplied by 1.5 while using a Bug-type attack.\",\"shortDesc\":\"At 1/3 or less of its max HP, this Pokemon's offensive stat is 1.5x with Bug attacks.\"},\"sweetveil\":{\"name\":\"Sweet Veil\",\"num\":175,\"desc\":\"This Pokemon and its allies cannot fall asleep, but those already asleep do not wake up immediately. This Pokemon and its allies cannot use Rest successfully or become affected by Yawn, and those previously affected will not fall asleep.\",\"shortDesc\":\"This Pokemon and its allies cannot fall asleep; those already asleep do not wake up.\"},\"swiftswim\":{\"name\":\"Swift Swim\",\"num\":33,\"desc\":\"If Rain Dance is active, this Pokemon's Speed is doubled. This effect is prevented if this Pokemon is holding a Utility Umbrella.\",\"shortDesc\":\"If Rain Dance is active, this Pokemon's Speed is doubled.\"},\"symbiosis\":{\"name\":\"Symbiosis\",\"num\":180,\"desc\":\"If an ally uses its item, this Pokemon gives its item to that ally immediately. Does not activate if the ally's item was stolen or knocked off, or if the ally used an Eject Button or Eject Pack.\",\"shortDesc\":\"If an ally uses its item, this Pokemon gives its item to that ally immediately.\"},\"synchronize\":{\"name\":\"Synchronize\",\"num\":28,\"desc\":\"If another Pokemon burns, paralyzes, poisons, or badly poisons this Pokemon, that Pokemon receives the same non-volatile status condition.\",\"shortDesc\":\"If another Pokemon burns/poisons/paralyzes this Pokemon, it also gets that status.\"},\"swordofruin\":{\"name\":\"Sword of Ruin\",\"num\":285,\"desc\":\"Active Pokemon without this Ability have their Defense multiplied by 0.75.\",\"shortDesc\":\"Active Pokemon without this Ability have their Defense multiplied by 0.75.\"},\"tabletsofruin\":{\"name\":\"Tablets of Ruin\",\"num\":284,\"desc\":\"Active Pokemon without this Ability have their Attack multiplied by 0.75.\",\"shortDesc\":\"Active Pokemon without this Ability have their Attack multiplied by 0.75.\"},\"tangledfeet\":{\"name\":\"Tangled Feet\",\"num\":77,\"desc\":\"This Pokemon's evasiveness is doubled as long as it is confused.\",\"shortDesc\":\"This Pokemon's evasiveness is doubled as long as it is confused.\"},\"tanglinghair\":{\"name\":\"Tangling Hair\",\"num\":221,\"desc\":\"Pokemon making contact with this Pokemon have their Speed lowered by 1 stage.\",\"shortDesc\":\"Pokemon making contact with this Pokemon have their Speed lowered by 1 stage.\"},\"technician\":{\"name\":\"Technician\",\"num\":101,\"desc\":\"This Pokemon's moves of 60 power or less have their power multiplied by 1.5, including Struggle. This effect comes after a move's effect changes its own power.\",\"shortDesc\":\"This Pokemon's moves of 60 power or less have 1.5x power, including Struggle.\"},\"telepathy\":{\"name\":\"Telepathy\",\"num\":140,\"desc\":\"This Pokemon does not take damage from attacks made by its allies.\",\"shortDesc\":\"This Pokemon does not take damage from attacks made by its allies.\"},\"teravolt\":{\"name\":\"Teravolt\",\"num\":164,\"desc\":\"This Pokemon's moves and their effects ignore certain Abilities of other Pokemon. The Abilities that can be negated are Aroma Veil, Aura Break, Battle Armor, Big Pecks, Bulletproof, Clear Body, Contrary, Damp, Dazzling, Disguise, Dry Skin, Filter, Flash Fire, Flower Gift, Flower Veil, Fluffy, Friend Guard, Fur Coat, Grass Pelt, Heatproof, Heavy Metal, Hyper Cutter, Ice Face, Ice Scales, Immunity, Inner Focus, Insomnia, Keen Eye, Leaf Guard, Levitate, Light Metal, Lightning Rod, Limber, Magic Bounce, Magma Armor, Marvel Scale, Mirror Armor, Motor Drive, Multiscale, Oblivious, Overcoat, Own Tempo, Pastel Veil, Punk Rock, Regal Presence, Sand Veil, Sap Sipper, Shell Armor, Shield Dust, Simple, Snow Cloak, Solid Rock, Soundproof, Sticky Hold, Storm Drain, Sturdy, Suction Cups, Sweet Veil, Tangled Feet, Telepathy, Thick Fat, Unaware, Vital Spirit, Volt Absorb, Water Absorb, Water Bubble, Water Veil, White Smoke, Wonder Guard, and Wonder Skin. This affects every other Pokemon on the field, whether or not it is a target of this Pokemon's move, and whether or not their Ability is beneficial to this Pokemon.\",\"shortDesc\":\"This Pokemon's moves and their effects ignore the Abilities of other Pokemon.\"},\"thermalexchange\":{\"name\":\"Thermal Exchange\",\"num\":270,\"desc\":\"This Pokemon's Attack is raised 1 stage after it is damaged by a Fire-type move. This Pokemon cannot be burned. Gaining this Ability while burned cures it.\",\"shortDesc\":\"This Pokemon's Attack is raised by 1 when damaged by Fire moves; can't be burned.\"},\"thickfat\":{\"name\":\"Thick Fat\",\"num\":47,\"desc\":\"If a Pokemon uses a Fire- or Ice-type attack against this Pokemon, that Pokemon's offensive stat is halved when calculating the damage to this Pokemon.\",\"shortDesc\":\"Fire-/Ice-type moves against this Pokemon deal damage with a halved offensive stat.\"},\"tintedlens\":{\"name\":\"Tinted Lens\",\"num\":110,\"desc\":\"This Pokemon's attacks that are not very effective on a target deal double damage.\",\"shortDesc\":\"This Pokemon's attacks that are not very effective on a target deal double damage.\"},\"torrent\":{\"name\":\"Torrent\",\"num\":67,\"desc\":\"When this Pokemon has 1/3 or less of its maximum HP, rounded down, its offensive stat is multiplied by 1.5 while using a Water-type attack.\",\"shortDesc\":\"At 1/3 or less of its max HP, this Pokemon's offensive stat is 1.5x with Water attacks.\"},\"toughclaws\":{\"name\":\"Tough Claws\",\"num\":181,\"desc\":\"This Pokemon's contact moves have their power multiplied by 1.3.\",\"shortDesc\":\"This Pokemon's contact moves have their power multiplied by 1.3.\"},\"toxicboost\":{\"name\":\"Toxic Boost\",\"num\":137,\"desc\":\"While this Pokemon is poisoned, the power of its physical attacks is multiplied by 1.5.\",\"shortDesc\":\"While this Pokemon is poisoned, its physical attacks have 1.5x power.\"},\"toxicchain\":{\"name\":\"Toxic Chain\",\"num\":305,\"desc\":\"This Pokemon's moves have a 30% chance of badly poisoning. This effect comes after a move's inherent secondary effect chance.\",\"shortDesc\":\"This Pokemon's moves have a 30% chance of badly poisoning.\"},\"toxicdebris\":{\"name\":\"Toxic Debris\",\"num\":295,\"desc\":\"If this Pokemon is hit by a physical attack, Toxic Spikes are set on the opposing side.\",\"shortDesc\":\"If this Pokemon is hit by a physical attack, Toxic Spikes are set on the opposing side.\"},\"trace\":{\"name\":\"Trace\",\"num\":36,\"desc\":\"On switch-in, this Pokemon copies a random opposing Pokemon's Ability. Abilities that cannot be copied are As One, Battle Bond, Comatose, Commander, Disguise, Flower Gift, Forecast, Gulp Missile, Hadron Engine, Hunger Switch, Ice Face, Illusion, Imposter, Multitype, Neutralizing Gas, Orichalcum Pulse, Power Construct, Power of Alchemy, Protosynthesis, Quark Drive, Receiver, RKS System, Schooling, Shields Down, Stance Change, Trace, Zen Mode, and Zero to Hero. If no opposing Pokemon has an Ability that can be copied, this Ability will activate as soon as one does.\",\"shortDesc\":\"On switch-in, or when it can, this Pokemon copies a random adjacent foe's Ability.\"},\"transistor\":{\"name\":\"Transistor\",\"num\":262,\"desc\":\"This Pokemon's offensive stat is multiplied by 1.3 while using an Electric-type attack.\",\"shortDesc\":\"This Pokemon's offensive stat is multiplied by 1.3 while using an Electric-type attack.\"},\"triage\":{\"name\":\"Triage\",\"num\":205,\"desc\":\"This Pokemon's healing moves have their priority increased by 3.\",\"shortDesc\":\"This Pokemon's healing moves have their priority increased by 3.\"},\"truant\":{\"name\":\"Truant\",\"num\":54,\"desc\":\"This Pokemon skips every other turn instead of using a move.\",\"shortDesc\":\"This Pokemon skips every other turn instead of using a move.\"},\"turboblaze\":{\"name\":\"Turboblaze\",\"num\":163,\"desc\":\"This Pokemon's moves and their effects ignore certain Abilities of other Pokemon. The Abilities that can be negated are Aroma Veil, Aura Break, Battle Armor, Big Pecks, Bulletproof, Clear Body, Contrary, Damp, Dazzling, Disguise, Dry Skin, Filter, Flash Fire, Flower Gift, Flower Veil, Fluffy, Friend Guard, Fur Coat, Grass Pelt, Heatproof, Heavy Metal, Hyper Cutter, Ice Face, Ice Scales, Immunity, Inner Focus, Insomnia, Keen Eye, Leaf Guard, Levitate, Light Metal, Lightning Rod, Limber, Magic Bounce, Magma Armor, Marvel Scale, Mirror Armor, Motor Drive, Multiscale, Oblivious, Overcoat, Own Tempo, Pastel Veil, Punk Rock, Regal Presence, Sand Veil, Sap Sipper, Shell Armor, Shield Dust, Simple, Snow Cloak, Solid Rock, Soundproof, Sticky Hold, Storm Drain, Sturdy, Suction Cups, Sweet Veil, Tangled Feet, Telepathy, Thick Fat, Unaware, Vital Spirit, Volt Absorb, Water Absorb, Water Bubble, Water Veil, White Smoke, Wonder Guard, and Wonder Skin. This affects every other Pokemon on the field, whether or not it is a target of this Pokemon's move, and whether or not their Ability is beneficial to this Pokemon.\",\"shortDesc\":\"This Pokemon's moves and their effects ignore the Abilities of other Pokemon.\"},\"unaware\":{\"name\":\"Unaware\",\"num\":109,\"desc\":\"This Pokemon ignores other Pokemon's Attack, Special Attack, and accuracy stat stages when taking damage, and ignores other Pokemon's Defense, Special Defense, and evasiveness stat stages when dealing damage.\",\"shortDesc\":\"This Pokemon ignores other Pokemon's stat stages when taking or doing damage.\"},\"unburden\":{\"name\":\"Unburden\",\"num\":84,\"desc\":\"If this Pokemon loses its held item for any reason, its Speed is doubled as long as it remains active, has this Ability, and is not holding an item.\",\"shortDesc\":\"Speed is doubled on held item loss; boost is lost if it switches, gets new item/Ability.\"},\"unnerve\":{\"name\":\"Unnerve\",\"num\":127,\"desc\":\"While this Pokemon is active, it prevents opposing Pokemon from using their Berries. This Ability activates before hazards and other Abilities take effect.\",\"shortDesc\":\"While this Pokemon is active, it prevents opposing Pokemon from using their Berries.\"},\"unseenfist\":{\"name\":\"Unseen Fist\",\"num\":260,\"desc\":\"This Pokemon's contact moves ignore the target's protection, except Max Guard.\",\"shortDesc\":\"This Pokemon's contact moves ignore the target's protection, except Max Guard.\"},\"vesselofruin\":{\"name\":\"Vessel of Ruin\",\"num\":284,\"desc\":\"Active Pokemon without this Ability have their Special Attack multiplied by 0.75.\",\"shortDesc\":\"Active Pokemon without this Ability have their Special Attack multiplied by 0.75.\"},\"victorystar\":{\"name\":\"Victory Star\",\"num\":162,\"desc\":\"This Pokemon and its allies' moves have their accuracy multiplied by 1.1.\",\"shortDesc\":\"This Pokemon and its allies' moves have their accuracy multiplied by 1.1.\"},\"vitalspirit\":{\"name\":\"Vital Spirit\",\"num\":72,\"desc\":\"This Pokemon cannot fall asleep. Gaining this Ability while asleep cures it.\",\"shortDesc\":\"This Pokemon cannot fall asleep. Gaining this Ability while asleep cures it.\"},\"voltabsorb\":{\"name\":\"Volt Absorb\",\"num\":10,\"desc\":\"This Pokemon is immune to Electric-type moves and restores 1/4 of its maximum HP, rounded down, when hit by an Electric-type move.\",\"shortDesc\":\"This Pokemon heals 1/4 of its max HP when hit by Electric moves; Electric immunity.\"},\"wanderingspirit\":{\"name\":\"Wandering Spirit\",\"num\":254,\"desc\":\"Pokemon making contact with this Pokemon have their Ability swapped with this one. Does not affect Pokemon with the As One, Battle Bond, Comatose, Commander, Disguise, Gulp Missile, Hadron Engine, Hunger Switch, Ice Face, Illusion, Multitype, Neutralizing Gas, Orichalcum Pulse, Power Construct, Protosynthesis, Quark Drive, RKS System, Schooling, Shields Down, Stance Change, Wonder Guard, Zen Mode, or Zero to Hero Abilities.\",\"shortDesc\":\"Pokemon making contact with this Pokemon have their Ability swapped with this one.\"},\"waterabsorb\":{\"name\":\"Water Absorb\",\"num\":11,\"desc\":\"This Pokemon is immune to Water-type moves and restores 1/4 of its maximum HP, rounded down, when hit by a Water-type move.\",\"shortDesc\":\"This Pokemon heals 1/4 of its max HP when hit by Water moves; Water immunity.\"},\"waterbubble\":{\"name\":\"Water Bubble\",\"num\":199,\"desc\":\"This Pokemon's offensive stat is doubled while using a Water-type attack. If a Pokemon uses a Fire-type attack against this Pokemon, that Pokemon's offensive stat is halved when calculating the damage to this Pokemon. This Pokemon cannot be burned. Gaining this Ability while burned cures it.\",\"shortDesc\":\"This Pokemon's Water power is 2x; it can't be burned; Fire power against it is halved.\"},\"watercompaction\":{\"name\":\"Water Compaction\",\"num\":195,\"desc\":\"This Pokemon's Defense is raised 2 stages after it is damaged by a Water-type move.\",\"shortDesc\":\"This Pokemon's Defense is raised 2 stages after it is damaged by a Water-type move.\"},\"waterveil\":{\"name\":\"Water Veil\",\"num\":41,\"desc\":\"This Pokemon cannot be burned. Gaining this Ability while burned cures it.\",\"shortDesc\":\"This Pokemon cannot be burned. Gaining this Ability while burned cures it.\"},\"weakarmor\":{\"name\":\"Weak Armor\",\"num\":133,\"desc\":\"If a physical attack hits this Pokemon, its Defense is lowered by 1 stage and its Speed is raised by 2 stages.\",\"shortDesc\":\"If a physical attack hits this Pokemon, Defense is lowered by 1, Speed is raised by 2.\"},\"wellbakedbody\":{\"name\":\"Well-Baked Body\",\"num\":273,\"desc\":\"This Pokemon is immune to Fire-type moves and raises its Defense by 2 stages when hit by a Fire-type move.\",\"shortDesc\":\"This Pokemon's Defense is raised 2 stages if hit by a Fire move; Fire immunity.\"},\"whitesmoke\":{\"name\":\"White Smoke\",\"num\":73,\"desc\":\"Prevents other Pokemon from lowering this Pokemon's stat stages.\",\"shortDesc\":\"Prevents other Pokemon from lowering this Pokemon's stat stages.\"},\"wimpout\":{\"name\":\"Wimp Out\",\"num\":193,\"desc\":\"When this Pokemon has more than 1/2 its maximum HP and takes damage bringing it to 1/2 or less of its maximum HP, it immediately switches out to a chosen ally. This effect applies after all hits from a multi-hit move. This effect is prevented if the move had a secondary effect removed by the Sheer Force Ability. This effect applies to both direct and indirect damage, except Curse and Substitute on use, Belly Drum, Pain Split, and confusion damage.\",\"shortDesc\":\"This Pokemon switches out when it reaches 1/2 or less of its maximum HP.\"},\"windpower\":{\"name\":\"Wind Power\",\"num\":277,\"desc\":\"This Pokemon gains the Charge effect when it takes a hit from a wind move or when Tailwind begins on this Pokemon's side.\",\"shortDesc\":\"This Pokemon gains the Charge effect when hit by a wind move or Tailwind begins.\"},\"windrider\":{\"name\":\"Wind Rider\",\"num\":274,\"desc\":\"This Pokemon is immune to wind moves and raises its Attack by 1 stage when hit by a wind move or when Tailwind begins on this Pokemon's side.\",\"shortDesc\":\"Attack raised by 1 if hit by a wind move or Tailwind begins. Wind move immunity.\"},\"wonderguard\":{\"name\":\"Wonder Guard\",\"num\":25,\"desc\":\"This Pokemon can only be damaged by supereffective moves and indirect damage.\",\"shortDesc\":\"This Pokemon can only be damaged by supereffective moves and indirect damage.\"},\"wonderskin\":{\"name\":\"Wonder Skin\",\"num\":147,\"desc\":\"Non-damaging moves that check accuracy have their accuracy changed to 50% when used against this Pokemon. This effect comes before other effects that modify accuracy.\",\"shortDesc\":\"Status moves with accuracy checks are 50% accurate when used on this Pokemon.\"},\"zenmode\":{\"name\":\"Zen Mode\",\"num\":161,\"desc\":\"If this Pokemon is a Darmanitan or Galarian Darmanitan, it changes to Zen Mode if it has 1/2 or less of its maximum HP at the end of a turn. If Darmanitan's HP is above 1/2 of its maximum HP at the end of a turn, it changes back to Standard Mode.\",\"shortDesc\":\"If Darmanitan, at end of turn changes Mode to Standard if > 1/2 max HP, else Zen.\"},\"zerotohero\":{\"name\":\"Zero to Hero\",\"num\":278,\"desc\":\"If this Pokemon is a Palafin in Zero Form, switching out has it change to Hero Form.\",\"shortDesc\":\"If this Pokemon is a Palafin in Zero Form, switching out has it change to Hero Form.\"}}");

